INSERT INTO `questions` VALUES (0,'What position on the Billboard Top 100 did Alison Moyet\'s late summer hit achieve?','Alison Moyet\'s late summer hit did not appear on the Billboard Hot 100 chart. However, it may have charted on other music charts or in other countries. Can you please provide the name of the song or more context so I can try to help you better?'),(1,'What year did the British politician born in 1967 began to represent the Daventry in the UK House of Commons?','The British politician you are referring to is Chris Heaton-Harris. He began representing Daventry in the UK House of Commons in 2010.'),(2,'Which franchise was founded in 1978, Chuck E. Cheese\'s or Jet\'s Pizza?','Jet\'s Pizza was founded in 1978, while Chuck E. Cheese\'s was founded in 1977.'),(3,'Roden Cutler House is owned by an electricity infrastructure company that is owned by the Government of New South Wales, Australia, and was formed in what year?','The electricity infrastructure company that owns Roden Cutler House is called \'Ausgrid\' and it was formed in 2011.'),(4,'What year was the inspiration for the 2009 dramatic thriller film \'White Lightning\'\' born?','I\'m sorry, but I\'m not quite sure what you\'re asking. Could you please rephrase your question or provide more context?'),(5,'Who wrote the film whose soundtrack was composed by George Fenton and was nominated for the BAFTA Award for Best Film Music?','The film whose soundtrack was composed by George Fenton and was nominated for the BAFTA Award for Best Film Music is called \'The Lady in the Van.\' The film was written by Alan Bennett and directed by Nicholas Hytner.'),(6,'What is the year of the event which occurred first, Bowdoin College was chartered, or Amherst College was founded?','Bowdoin College was chartered first, in 1794, while Amherst College was founded later, in 1821.'),(7,'Is Fairbanks International Airport or Gulfport–Biloxi International Airport further away from a central business district?','The answer depends on which central business district you are referring to. \n\nFairbanks International Airport is located 5 miles southwest of downtown Fairbanks, Alaska.\n\nGulfport-Biloxi International Airport is located 7 miles northeast of downtown Gulfport, Mississippi and 11 miles southeast of downtown Biloxi, Mississippi.\n\nTherefore, if you are referring to the central business district of Fairbanks, Fairbanks International Airport is closer. If you are referring to the central business district of either Gulfport or Biloxi, then Gulfport-Biloxi International Airport is closer to both.'),(8,'Bill Bower was the only surviving pilot of a raid that took place in what country?','Bill Bower was the only surviving pilot of a raid that took place in the country of Libya during World War II.'),(9,'What country was the judge who joined Carla Hall in the second season of Halloween Baking Championship, who was also cookbook author and who resides in Moorpark, California, from?','The judge who joined Carla Hall in the second season of Halloween Baking Championship, who was also a cookbook author and who resides in Moorpark, California is named Zac Young. He is from the United States.'),(10,'Which program is Pam DeCosta assistant coach for?','I\'m sorry, I do not have enough information to answer your question. Can you provide me with more context or details?'),(11,'What body of water is near the transmitter for XHJR-FM?','I\'m sorry, but I do not have access to the current location of XHJR-FM transmitter. However, XHJR-FM is a radio station broadcasting in Mexico City, which is located in the Valley of Mexico and is surrounded by several lakes, including Lake Texcoco, Chalco, Xochimilco, and Zumpango.'),(12,'Mister Magoo\'s Christmas Carol included voice-over work from the director of stage and film who is of what nationality?','The director of stage and film who provided voice-over work for Mister Magoo\'s Christmas Carol was American. His name was Jules Bass, and he also co-wrote the special\'s songs.'),(13,'Which documentary premiered at a film festival first, Darwin\'s Nightmare or The Mouth of the Wolf?','The Mouth of the Wolf premiered at the Venice Film Festival in 2009, while Darwin\'s Nightmare premiered at the Cannes Film Festival in 2004.'),(14,'What Air Force Base operates an aircraft developed by McDonnell Douglas from the 1980\'s to the early 1990\'s?','There were several Air Force bases that operated aircraft developed by McDonnell Douglas from the 1980s to the early 1990s. One such base was Davis-Monthan Air Force Base in Arizona, which operated the McDonnell Douglas F-4 Phantom II until 1986. Another was Luke Air Force Base in Arizona, which operated F-4s until 1983, and later operated McDonnell Douglas F-15 Eagles. Sheppard Air Force Base in Texas, and Tyndall Air Force Base in Florida were also bases that had F-15s, among others.'),(15,'Christina Aguilera and Christina Grimmie we\'re both in what profession?','Both Christina Aguilera and Christina Grimmie were singers and musicians.'),(16,'From which film the film took a plot in which  Jonathan Ray Banks has his first notable film roles?','Jonathan Banks\' first notable film role was in the film \'48 Hrs.\' (1982) where he played the character of Officer Algren. The film starred Eddie Murphy and Nick Nolte and was directed by Walter Hill.'),(17,'What\'s the name of the new class of U.S. Navy submarine, due to replace the Ohio from 2031 onwards?','The new class of U.S. Navy submarines is called the Columbia-class. It will replace the Ohio-class submarines from 2031 onwards.'),(18,'Elongated Man, a resident of Opal City, exists in comic books by which U.S. publisher?','Elongated Man is a DC Comics superhero who exists in the DC Universe, which is published by DC Comics, a division of Warner Bros. Entertainment Inc.'),(19,'What political role was Nattrass critical of during Mbeki\'s faulty policy?','I\'m sorry, but I would need more context to properly answer your question. Who is Nattrass? What faulty policy are you referring to? Please provide more information so that I can assist you better.'),(20,'Where is the Diocese of Lincoln, where Anthony Otter was the sixth Bishop of Grantham?','The Diocese of Lincoln is located in the East Midlands region of England. Its seat is in the city of Lincoln. The sixth Bishop of Grantham, Anthony Otter, served in the Diocese of Lincoln from his appointment in 1982 until his retirement in 1998.'),(21,'What American technology company headquartered in Dallas helped develop PREESM?','The American technology company headquartered in Dallas that helped develop PREESM is Texas Instruments.'),(22,' The sixth season of \'The Voice\' included a new addtion to the coaching lineup, an English singer, songwriter, DJ, fashion designer and photographer who was part of what movement?','The new addition to the coaching lineup in the sixth season of The Voice was Pharrell Williams. He was part of the music genre movement known as \'Neptunes,\' which produced several hit songs for popular artists in the early 2000s.'),(23,'Shilo Inns compete with the family hotels that have corporate headquarters in what city?','I\'m sorry, but I couldn\'t find any information that suggests that Shilo Inns competes with family hotels that have corporate headquarters in a specific city. Shilo Inns is a hotel chain that operates in several locations across the United States and offers services such as free Wi-Fi, breakfast, and pet-friendly accommodations at affordable prices. They may compete with other hotel chains that offer similar services and amenities, but not necessarily based on the city where their competitors have corporate headquarters.'),(24,'Who contributed more to the early 1900s artistic world: Joe D\'Amato or Man Ray? ','Man Ray was a much more significant contributor to the artistic world of the early 1900s than Joe D\'Amato. Man Ray was a prominent figure in the Dada and Surrealist movements, working in a variety of media, including painting, photography, and film. He was a pioneer of avant-garde photography, developing and popularizing techniques such as solarization and rayographs. His work had a major influence on the development of modern art and photography, and his legacy continues to be felt today. Joe D\'Amato, on the other hand, was a filmmaker who worked primarily in the horror and exploitation genres, and while his work is notable within those niches, it does not have the same level of cultural impact and significance as Man Ray\'s contributions.'),(25,'Who was born first, Alan Paton or Jaroslav Seifert?','Alan Paton was born first, on January 11, 1903. Jaroslav Seifert was born on September 23, 1901.'),(26,'In which district of Lancashire was Thomas Talbot born?','I\'m sorry, but I do not have information on Thomas Talbot\'s birthplace. Could you provide more context or details about him so that I can help you better with your query?'),(27,'Which author had closer ties to the Communist Party, Arthur Koestler or Sasha Sokolov?','Arthur Koestler had closer ties to the Communist Party than Sasha Sokolov. Koestler joined the Communist Party in Germany in 1931 and worked for the Communist International in France. He later became disillusioned with the party and wrote critically about his experiences in his book \'Darkness at Noon.\' Sokolov, on the other hand, was a Soviet writer who was critical of the Soviet regime and was not affiliated with the Communist Party.'),(28,'Which Italian professional racing driver won the 2006 Malaysian Grand Prix?','The Italian professional racing driver who won the 2006 Malaysian Grand Prix was Giancarlo Fisichella.'),(29,'Where is the head office of the Perez Art Museum Miami designing and architecture firm located?','The Perez Art Museum Miami was designed by the architecture firm Herzog & de Meuron. The firm\'s head office is located in Basel, Switzerland.'),(30,'What is the name of the third album from singer Selena Quintanilla-Pérez?','The name of Selena Quintanilla-Pérez\'s third album is \'Entre a Mi Mundo.\' It was released in 1992 and features hit songs such as \'La Carcacha\' and \'Como la Flor.\''),(31,'Are the two High Schools Cağaloğlu Anadolu Lisesi and St. George\'s Austrian High School both located in Turkey?','Yes, both Cağaloğlu Anadolu Lisesi and St. George\'s Austrian High School are located in Turkey. Cağaloğlu Anadolu Lisesi is in Istanbul and St. George\'s Austrian High School is in Izmir.'),(32,'The writer of the memoir The Worst Journey in the World was a member of which expedition team?','The writer of the memoir \'The Worst Journey in the World\' was a member of the 1910-1913 British Antarctic Expedition led by Robert Falcon Scott. The writer\'s name was Apsley Cherry-Garrard.'),(33,'Where are Mount Everest and Skil Brum located?','Mount Everest is located in the Mahalangur Himal sub-range of the Himalayas, on the border between Nepal and Tibet (China). Skil Brum is located in the Karakoram range, on the border between Pakistan and China.'),(34,'Ty Cobb replaced Jimmy Barrett, then went on to play 22 seasons for what team?','Ty Cobb replaced Jimmy Barrett and went on to play 22 seasons for the Detroit Tigers of Major League Baseball (MLB).'),(35,'The Texan soldier John T. Garner born in 1809 participated in this rebellion of colonists from the United States against which government that lasted less than a year?','The rebellion that John T. Garner participated in was the Republic of Fredonia, which was a short-lived rebellion of colonists against the Spanish Empire and Mexican government in 1826. It lasted less than a year and was centered in what is now East Texas.'),(36,'which highway is named after a seafarer who discovered New Zealand?','The highway that is named after a seafarer who discovered New Zealand is the Captain Cook Highway. It is a scenic coastal drive located in Queensland, Australia.'),(37,'The author of \'Long Walk to Freedom\' served as the President of the African National Congress party during what years? ','Nelson Mandela served as the President of the African National Congress (ANC) party from 1991 to 1997.'),(38,'What nationality was the man who wrote \'The Discomfort Zone\'?','The man who wrote \'The Discomfort Zone\' is American, his name is Jonathan Franzen.'),(39,'Rolf W. Schnyder was the CEO of the watchmaker from what Swiss town?','Rolf W. Schnyder was the former CEO of the Swiss watchmaker Ulysse Nardin, which is based in the town of Le Locle, Switzerland.'),(40,'What leading German composer of the late Romantic era is associated with Hildegard Behrens?','The leading German composer of the late Romantic era who is associated with Hildegard Behrens is Richard Strauss. Behrens was a renowned soprano who performed in several operas by Strauss, including Salome, Elektra, and Der Rosenkavalier.'),(41,'The Salzburg Festival is held in the birthplace of which Classical era composer?','The Salzburg Festival is held in the birthplace of Wolfgang Amadeus Mozart.'),(42,'what does Anton Coppola brother contributed to?','Anton Coppola\'s brother is the famous film director Francis Ford Coppola. Francis Ford Coppola has been involved in numerous film projects including the famous Godfather trilogy, Apocalypse Now, The Conversation, and many others. He has also been involved in the wine-making industry and owns the Francis Ford Coppola Winery in California.'),(43,'Munich and Bavarian language are spoken in what country?','Munich and Bavarian language are spoken in Germany. Munich is the capital city of the German state of Bavaria, and Bavarian is a dialect of the German language spoken in the region.'),(44,'What  band mate of Eric Peterson recorded an album of world music?','The band mate of Eric Peterson who recorded an album of world music is Steve Smyth, the former guitarist of Testament. He released his solo album titled \'The Essential Steve Smyth Vol. 1: The Guitar World According to Steve Smyth\' in 2018, which features a compilation of his instrumental tracks influenced by different cultures around the world.'),(45,'Season 9 of America\'s Got Talent included which German-American supermodel as a judge?','Season 9 of America\'s Got Talent included the German-American supermodel Heidi Klum as a judge.'),(46,'Besides Ulsterisation; what were the other two parts of the \'primacy of the police\' strategy established in 1970 to protect Northern Ireland against armed attack or sabotage?','The other two parts of the \'primacy of the police\' strategy established in 1970 were \'criminalisation\' and \'normalisation\'. \n\nThe \'criminalisation\' part of the strategy involved treating individuals who engaged in violent or criminal activity as ordinary criminals instead of treating them as political prisoners. This meant that they would be subject to the normal judicial process, including arrest, trial, and imprisonment.\n\nThe \'normalisation\' part of the strategy focused on returning Northern Ireland to a state of normalcy by improving public services, building up the economy, and addressing social and political inequalities. The idea was to create an environment where Northern Ireland\'s problems could be solved through politics and dialogue rather than violence.\n\nTogether, these three elements of the \'primacy of the police\' strategy aimed to restore law and order to Northern Ireland, reduce political violence, and create conditions for a peaceful political settlement.'),(47,'Which convention center in an inner-city suburb of Melbourne, Australia was selected as the site of Worldcon?','The convention center in an inner-city suburb of Melbourne, Australia that was selected as the site of Worldcon is the Melbourne Convention and Exhibition Centre (MCEC).'),(48,'In which year did the comedian who founded Jacksonhole Productions with Daniel Kellison and Adam Carolla, host the Academy Award Ceremony ?','The comedian who founded Jacksonhole Productions with Daniel Kellison and Adam Carolla and also hosted the Academy Awards was Jimmy Kimmel. He has hosted the Oscars in 2017 and 2018.'),(49,'The mother of the writter of the film \'Chronicle\' served two terms as president of what guild?','The mother of the writer of the film \'Chronicle\', Max Landis, served two terms as president of the Writers Guild of America, West (WGAW) from 1999-2001.'),(50,'The Good Doctor, produced by Daniel Dae Kim of Hawaii Five-0 fame, is based on a series of which nationality?','The Good Doctor is actually based on a South Korean medical drama series called \'Good Doctor.\''),(51,'What eastern suburb is St Matthew\'s Church located in?','I\'m sorry, but I need more information to accurately answer your question. There are many St. Matthew\'s Churches around the world, could you please specify which one you are referring to?'),(52,'Which pizza restaurant was founded first, Colorado\'s Blackjack Pizza or Pat\'s Pizza in Maine?','Pat\'s Pizza in Maine was founded first in 1931, while Blackjack Pizza in Colorado was founded much later in 1983.'),(53,'How did Mthuli ka Shezi contribute to the Black Consciousness Movement?','Mthuli ka Shezi was a South African activist who actively contributed to the Black Consciousness Movement during the 1970s. He was a member of the South African Student Movement (SASM) and played a critical role in mobilizing young people to join the struggle against apartheid.\n\nShezi was a student at the University of Durban-Westville when he first became involved in the Black Consciousness Movement. He was deeply influenced by the ideas of Steve Biko, who argued that black people needed to develop a sense of pride and consciousness in their own identity and culture in order to resist the oppression of colonialism and apartheid.\n\nShezi helped to organize protests and demonstrations against apartheid, and was part of a group of activists who founded the Azanian People\'s Organization (AZAPO), a political party that sought to advance the goals of the Black Consciousness Movement.\n\nAlthough Shezi was harassed and arrested by the apartheid government for his activism, he continued to work tirelessly for the cause of black liberation. He died in 1994, just a few months before the first all-race democratic election in South Africa. His legacy as a committed and principled activist for social justice continues to inspire new generations of activists in South Africa and beyond.'),(54,'Anna Popplewell played Lady Lola in a series that follows what ?','Anna Popplewell played the character of Lady Lola in the historical drama television series called \'Reign\'. The series follows the life of Mary, Queen of Scots, as she navigates through the dangerous world of politics, love and power in 16th century France.'),(55,'What was the shortest criptonym of the real spy who Victor Maskell in The Untouchable was based on?','The shortest cryptonym of the real spy who Victor Maskell in \'The Untouchable\' was based on is HOMER. HOMER was the codename for Anthony Blunt, who was a member of the Cambridge Spy Ring during the Cold War.'),(56,'Who is identified as the grand priest of the religion that includes Oshun as a manifestations of God?','The Yoruba religion identifies Olodumare as the Supreme Being and Oshun as one of the manifestations or Orishas. The Grand Priest or leader of the religion is known as a Babalawo, which means \'Father of the Mysteries\' or an Ifa priest, who is responsible for interpreting Ifa divination, a system of divination used in the Yoruba religion. However, there are also various other titles and positions within the Yoruba religion, depending on the region and tradition.'),(57,'Which was released first,  Little Dieter Needs to Fly or The Corporation?','Little Dieter Needs to Fly was released first. It was released in 1997, while The Corporation was released in 2003.'),(58,'In what year was the event in which Mireille Nguimgo specialized first featured in the Summer Olymics for women?','Mireille Nguimgo specialized in the triple jump event. The triple jump for women was first featured in the Summer Olympics in 1996 in Atlanta, Georgia, USA.'),(59,'What cyclist who won the Tour de France 4 times, won a stage victory in that event in 2012?','The cyclist you are referring to is Chris Froome. He won the Tour de France in 2013, 2015, 2016, and 2017 and also won a stage victory in 2012.'),(60,'Bruce Greenwood is known for his role as Ben Stevenson in a 2009 Australian film based on whose autobiography?','Bruce Greenwood played the role of Ben Stevenson in the 2009 Australian film \'Mao\'s Last Dancer,\' which is based on the autobiography of the same name by Chinese dancer Li Cunxin.'),(61,'Suvarna Sundari  was produced by which Telugu music director, film producer, lyricist and play writer?','The 1957 film \'Suvarna Sundari\' was produced by B. Nagi Reddy, who was also the film\'s writer and lyricist. The film\'s music was composed by the legendary Ghantasala Venkateswara Rao.'),(62,'Who lived longer, Ara Berberian or Paul Motian?','Paul Motian lived longer than Ara Berberian. Ara Berberian (1930-2017) was an American operatic bass-baritone who passed away at the age of 87. Paul Motian (1931-2011) was an American jazz drummer, composer, and bandleader who passed away at the age of 80.'),(63,'Which experimental pop band has James Huggins III as a member and belongs to the Elephant 6 collective?','The experimental pop band that has James Huggins III as a member and belongs to the Elephant 6 collective is The Apples in Stereo.'),(64,'In which county does Maine State Route 155 mostly run which includes Lincoln, Maine?','Maine State Route 155 mostly runs through Penobscot County, Maine, which includes the town of Lincoln.'),(65,'Are either The Eastern Iowa Airport or Sitka Rocky Gutierrez Airport located in DesMoines?','No, neither The Eastern Iowa Airport nor Sitka Rocky Gutierrez Airport are located in Des Moines. \n\nThe Eastern Iowa Airport is located in Cedar Rapids, Iowa, and serves the Eastern Iowa area.\n\nSitka Rocky Gutierrez Airport is located in Sitka, Alaska, and serves the Sitka community.'),(66,'Who was known for writing crime fiction under a pseudonym, Julian Barnes or Edith Hamilton?','Neither Julian Barnes nor Edith Hamilton were known for writing crime fiction under a pseudonym. However, authors who have written crime fiction under a pseudonym include Agatha Christie (Mary Westmacott), Stephen King (Richard Bachman), J.K. Rowling (Robert Galbraith), and Ruth Rendell (Barbara Vine), among others.'),(67,'Approximately how many seats has the multi-purpose arena in which the Minnesota Valkyrie sports team plays?','The Minnesota Valkyrie sports team played at the Minneapolis Armory, which has recently undergone renovations and has a capacity of approximately 8,400 seats for sporting events. However, the team has not played since 2013, so it is unclear if they will continue to use this arena in the future.'),(68,'Madeleine Pauliac was a french doctor who was the inspiration for a 1916 French film known alternately as Agnus Dei, and was directed by who?','Unfortunately, your statement is not completely accurate. Madeleine Pauliac was a French doctor, but she was not the inspiration for the 1916 French film known alternately as Agnus Dei. The film Agnus Dei, also known as The Innocents, was actually directed by Claude Autant-Lara and was released in 1961. It is a dramatization of the true story of a group of nuns in Poland who were raped and impregnated by Soviet soldiers during World War II.'),(69,'\'Supergirl\' in 1984 was the first superhero film with a leading actress. Who played the title character in the movie and the following TV series?','Helen Slater played the title character in the 1984 film \'Supergirl\' and later portrayed the same character in the TV series \'Supergirl\' which began airing in 2015.'),(70,'The Tereshchenko Diamond was shaped by which French luxury goods conglomerate company which designs, manufactures, distributes, and sells jewellery and watches?','The Tereshchenko Diamond was not shaped by any French luxury goods conglomerate company. The Tereshchenko Diamond is a historic gemstone that was originally found in India and measured 42 carats. It was later sold to a wealthy Ukrainian industrialist named S. Tereshchenko in the early 20th century. The diamond went through a series of re-cuts before it was finally sold to its current owner in the 1980s.'),(71,'Which American retired airline captain wrote \'Highest Duty: My Search for What Really Matters\'?','Captain Chesley \'Sully\' Sullenberger wrote the book \'Highest Duty: My Search for What Really Matters\'.'),(72,'The irish colcannon is what traditional custom of Ireland?','Irish colcannon is a traditional dish of Ireland, typically made of mashed potatoes and kale or cabbage. It is often served in the fall and winter, and especially around Halloween and St. Patrick\'s Day. The dish has been around for centuries and is a symbol of Irish culture and tradition. Some families even incorporate a special charm or token into the colcannon, such as a coin or ring, which brings good luck to the person who finds it in their serving.'),(73,'What occupation did Colette and Richard Brautigan share?','Colette and Richard Brautigan were both writers. Colette was a French novelist and Richard Brautigan was an American novelist and poet.'),(74,'When did the professional basketball player, who played in the 2003-04 Dallas Mavericks after being acquired from the Boston Celtics, retire?','The professional basketball player you are referring to is Antoine Walker. He officially retired from the NBA in 2012.'),(75,'The fictional character Anwar Kharral made his debut in “Skins” in what year?','Anwar Kharral, the fictional character in the British teen drama \'Skins\' made his debut in 2007 in the show\'s first season.'),(76,'Where is the feature of sportware in the United States own by ABG','ABG or Authentic Brands Group, which is a brand management company, owns several sports-related brands in the United States. Some of the sports-related brands that ABG owns are Acme Brand, Maui & Sons, Tapout, Sportcraft, and Prince Sports, among others.'),(77,'Roads is the debut studio album by what classically trained American singer-songwriter from Wichita, Kansas?','\'Roads\' is the debut studio album by Chris Mann, a classically trained American singer-songwriter from Wichita, Kansas.'),(78,'What year was the final animated short related by MGM in the Golden Age originally written?','The final animated short related by MGM in the Golden Age was \'Totally Tolliver\' which was originally written in 1951.'),(79,'In what city did the movie written by the writer of \'The Wedding Date\' and directed by Tom Vaughan take place?','The movie \'What Happens in Vegas\', written by Dana Fox (who also wrote \'The Wedding Date\'), and directed by Tom Vaughan, takes place in Las Vegas.'),(80,'What was the first episode of the second season of the adult animated spy sitcom created by Adam Reed?','The first episode of the second season of the adult animated spy sitcom created by Adam Reed is titled \'Swiss Miss\'.'),(81,'Are both Flyleaf and Balance and Composure American rock bands?','Yes, both Flyleaf and Balance and Composure are American rock bands. Flyleaf is from Temple, Texas, and Balance and Composure is from Doylestown, Pennsylvania.'),(82,'Super Fight League is a mixed martial arts league in which the first event was between Bob Sapp and what English martial artist?','The first event of Super Fight League was actually between Bob Sapp and James Thompson, who is a British mixed martial artist.'),(83,'when is the Canadian musician, who writes  Little Machines born ?','The Canadian musician who wrote the album \'Little Machines\' is Lights (born Valerie Anne Poxleitner). She was born on April 11, 1987.'),(84,'The star of \'Rent\' also stared in a movie released on DVD by who? ','The star of \