unist party and was invited to participate in the electoral leftist alliance group. The PCI played a significant role in Italian politics for many years and was part of the popular front government that governed the country during the Second World War.'),(723,'Born 4 November 1985 in Karachi this cricketer was suspended by the PCB in 2017.','The cricketer you are referring to is Khalid Latif.'),(724,'She plays Mona Simpson on the Simpsons and is also the voice of Babs Bunny, Wilma Flinstone, Mom, Agnes Skinner and Dot, she has also done Daisy Duck.','The actress who plays Mona Simpson on The Simpsons, and also voices Babs Bunny, Wilma Flintstone, Mom, Agnes Skinner and Dot, is Tress MacNeille. She is a highly respected voice actress in the industry and has worked on several other animated series and films throughout her career.'),(725,'Who was a manager of the team which John Tortes \'Chief\' Meyers played on in the 1911, 1912 and 1913 World Series?','John Tortes \'Chief\' Meyers played for the New York Giants in the 1911, 1912, and 1913 World Series. The manager of the Giants during that time was John McGraw.'),(726,'Where is the Japanese rice cake eaten that is steamed?','The Japanese rice cake that is typically steamed is called \'mochi\'. Mochi is a traditional Japanese food that is commonly eaten during New Year\'s celebrations, but it can also be enjoyed year-round. It is often served as a sweet treat, filled with sweetened red bean paste or other sweet fillings, or as a savoury dish, wrapped around a filling of meat or vegetables. Mochi can be found in many Japanese restaurants and specialty food stores worldwide.'),(727,'Where is the band that is included in Say What?! from?','The band that is included in \'Say What?!\' is the John Mayer Trio, which consists of American musicians John Mayer, Steve Jordan, and Pino Palladino. They formed the band in 2005, and they have primarily played blues rock music.'),(728,'Year of the Savage included production duties by