 triodetic domes are known to have a high load capacity due to their unique design, which distributes weight evenly over the entire structure. \nFor example, a small garden dome measuring 7 feet in diameter can hold up to 1,000 pounds, while a larger dome with a diameter of 60 feet can carry up to 200,000 pounds. \nIt is important to consult with a structural engineer to determine the maximum load capacity for a specific triodetic dome design.'),(736,'In what city was the 1927 German science-fiction drama film \'Metropolis\' produced?','The 1927 German science-fiction drama film \'Metropolis\' was produced in Berlin, Germany.'),(737,'What music video did about the lead character in the movie \'Chopper\' also do?','The music video that featured the lead character in the movie \'Chopper\' is titled \'Chopper\' and was performed by the Australian band, The Living End. The music video features Eric Bana, who played the lead character in the movie, and scenes from the film.'),(738,'Which job title did Lise Meitner and Otto Robert Frisch share?','Lise Meitner and Otto Robert Frisch were both nuclear physicists. They are particularly known for their work on nuclear fission, which helped lay the foundations for the development of nuclear power and the atomic bomb.'),(739,'The Hawaiian Island of Island contains two volcanoes, What is the smallest volcano that accounts for 25% of the Hawaiian Island of Maui?','The Hawaiian Island of Maui contains three volcanoes, not two: Haleakala, West Maui Mountains, and Mauna Kahalawai. However, I can tell you that Haleakala, which is also the largest volcano on the island, covers more than 75% of Maui, while the West Maui Mountains and Mauna Kahalawai account for the rest.'),(740,'How many kilometers long is the cyclist/pedestrian path that accesses the Melbourne Zoo?','The length of the cyclist/pedestrian path that accesses the Melbourne Zoo depends on the starting point of the path. Could you please provide me with your starting locati