 The computer worm was distributed by the computer scientist in question in 1988, which caused significant damage to computer systems, resulting in his conviction under the CFAA in 1990.'),(745,'Which band was formed first Gumball or Starset?','Gumball was formed first. The band was formed in 1987 by Don Fleming, Eric Vermillion, and Jay Spiegel in New York City. On the other hand, Starset was formed in 2013, in Columbus, Ohio by Dustin Bates.'),(746,'A good friend of Francis Ricardo Ferrero plays for what team?','I\'m sorry, but I do not have enough information to answer that question. Could you provide more context or details about Francis Ricardo Ferrero and his friend?'),(747,'What was the inspiration for the movie that the song \'Let It Go\' is from?','The inspiration for the movie that features the song \'Let It Go\' is actually the fairy tale \'The Snow Queen\' by Hans Christian Andersen. However, the plot and characters of Disney\'s \'Frozen\' are quite different from the original story.'),(748,'In what country did the Halifax ass shooting plot occur?','The Halifax shooting plot occurred in Canada.'),(749,'Twelve years before Tollund Man\'s discovery, which bog body was discovered in 1938?','In 1938, the bog body of Grauballe Man was discovered in Denmark, which is another well-preserved Iron Age body like the Tollund Man.'),(750,'Which genus of plant grows larger, Cobaea, or Galanthus?','Cobaea plants, which are commonly known as cup and saucer vines, can grow up to 30 feet in length, depending on the species, making them much larger than Galanthus plants. Galanthus, which are often called snowdrops, typically only grow to be a few inches tall.'),(751,'Are The Four Seasons and The Contortionist from the same country?','Yes, The Four Seasons and The Contortionist are both from the United States. The Four Seasons is a well-known pop group from the 1960s, while The Contortionist is a progressive metal band from Indiana.'),(752,'The Scorch Trials was followed by a book that was published on what date?','The book that follows The Scorch Trials is called The Death Cure, and it was published on October 11, 2011.'),(753,'In what direction does the street that O. Henry Hall, located on in Austin, Texas, run?','O. Henry Hall is located at 601 Colorado St, Austin, TX 78701. The street in front of O. Henry Hall runs north-south, while Colorado Street itself runs northeast-southwest.'),(754,'Who won both the 2014 Chicago Marathon men\'s race and the gold medal in the 2016 Olympic Marathon?','The person who won both the 2014 Chicago Marathon men\'s race and the gold medal in the 2016 Olympic Marathon is Eliud Kipchoge of Kenya.'),(755,'Bill Rice has written songs for an American country music singer whose greatest musical success came in the early to mid 1970s, when he became the best selling performer for RCA Records, since who?','Bill Rice has written songs for a few American country music singers, but the one described in the question is probably Charley Pride. Charley Pride was RCA Records best selling performer in the early to mid 1970s, and Bill Rice wrote several songs for him during that time.'),(756,'Are Chris Evert and Danie Visser both professional tennis players?','Yes, Chris Evert and Danie Visser are both former professional tennis players. Chris Evert is a retired American tennis player who won 18 Grand Slam singles titles and three doubles titles during her career. Danie Visser is a retired South African tennis player who reached the doubles #1 ranking and won four Grand Slam doubles titles during his career.'),(757,'Heaven\'s Gate is a phrase made familiar from a William Shakespeare sonnet that is part of what sequence? ','Actually, the phrase \'heaven\'s gate\' appears in several of Shakespeare\'s works and sonnets, so it\'s not clear which sequence you\'re referring to. However, the most famous use of this phrase is in Sonnet 29, which begins \'When in disgrace with fortune and men\'s eyes.\''),(758,'Snow White a