e in reviving interest in?','Eugene O\'Growney was a key figure in reviving interest in the Irish language.'),(1382,'What is the name of the supermarket chain which is based in Keasbey, New Jersey, and is one of the 500 largest private companies in the United States according to the 2008 Forbes.com list of America\'s Largest Private Companies?','The name of the supermarket chain you are referring to is Wakefern Food Corporation, which operates stores under the ShopRite and PriceRite banners.'),(1383,'Jack and Gerald Brisco are known for being involved with what sport?','Jack and Gerald Brisco are both known for being involved with professional wrestling, both as wrestlers and behind-the-scenes roles such as talent scouting and booking.'),(1384,'Which one of the twentieth century\'s major poets was Carbucketty names idea','Carbucketty is not typically associated with any of the major poets of the twentieth century. However, Carbucketty is a character from the musical Cats by Andrew Lloyd Webber, based on the poetry of T.S. Eliot. Eliot is considered one of the major poets of the twentieth century, known for works such as The Waste Land and Four Quartets.'),(1385,'The Republican who introduced Global Food Security Act of 2016 was nominated by what president to become a representative to the United Nations General Assembly?','The Republican who introduced the Global Food Security Act of 2016 was Senator Johnny Isakson of Georgia. However, I am not certain which president nominated him to become a representative to the United Nations General Assembly. Can I assist you with anything else?'),(1386,'Who played the leading role in the 2013 zombie romantic comedy Warm Bodies?','The leading role in the 2013 zombie romantic comedy \'Warm Bodies\' was played by Nicholas Hoult.'),(1387,'When was the nickname for American infantry first used?','The nickname for American infantry \'Doughboys\' was first used during World War I. The term is believed to have originated from the adap