rgian and Exploits Valley Air Services. These airlines operate under the Air Canada Express brand.'),(3078,'Min Áigi is a newspaper written in which of the most popular of the Sami languages?','Min Áigi is a newspaper written in Northern Sami which is one of the most widely spoken and written of the Sami languages.'),(3079,'Léopold Sédar Senghor was associated with what movement that is largely used in a racist context?','Léopold Sédar Senghor was associated with the Négritude movement, which celebrated and emphasized black culture and identity. However, the concept of Négritude has been controversial and has been criticized for essentializing and romanticizing blackness in a way that can be interpreted as exclusionary to non-black people. The term has also been used in a racist context, particularly in the past, in attempts to categorize and marginalize black people.'),(3080,'What happened earlier, the founding of W, or the closing of Harrods Buenos Aires?','It is difficult to determine which event happened earlier without specific dates, as the founding of W and the closing of Harrods Buenos Aires could have happened in different years or even different centuries. However, Harrods Buenos Aires did go bankrupt and close its doors in 1998, while W Hotels & Resorts was founded in 1998, so it\'s possible that the founding of W happened around the same time as the closing of Harrods Buenos Aires or shortly thereafter.'),(3081,'Who is the famous Milan goalkeeper currently represented by agent Mino Raiola?','The famous Milan goalkeeper currently represented by agent Mino Raiola is Gianluigi Donnarumma.'),(3082,'Garry Schyman has composed for several games, writing the scores to which 2010 action-adventure video game developed by Visceral Games and published by Electronic Arts for the Xbox 360 and PlayStation 3 consoles?','Garry Schyman composed the score for the 2010 action-adventure video game \'Dead Space 2\' developed by Visceral Games and published by Electronic Arts for the Xbox 360 and PlayStation 3 consoles.'),(3083,'Hardware LDN has a range in which men\'s clothing counterpart of Topshop?','Hardware LDN carries a range of men\'s clothing and accessories that are similar in style to Topshop, although they are not necessarily a direct counterpart to the women\'s clothing offered by Topshop. Some of the styles and items that you can find at Hardware LDN include statement jackets, graphic tees, oversized hoodies, and bold accessories like watches and sunglasses. They also offer a wide range of denim options, including distressed and embroidered styles. If you\'re looking for men\'s clothing that has a trendy, fashion-forward feel, Hardware LDN may be a good option for you.'),(3084,'What was the orginal name of the boxer who beat Jimmy Young in 1976','The original name of the boxer who beat Jimmy Young in 1976 was Muhammad Ali.'),(3085,'Where is the Jerusalem Central Bus Station located?','The Jerusalem Central Bus Station is located at 3 Jaffa Road, Jerusalem. It is one of the busiest and largest bus stations in the world, serving as a hub for local and regional buses, as well as international buses to various destinations in Europe and the Middle East.'),(3086,'Ralph Helfer created a park in what town? ','Ralph Helfer created a park called \'Shambala Preserve\' in Acton, California.'),(3087,'What city is the headquarters of the company that published Pengo?','The company that published Pengo is Sega, and its headquarters is located in Tokyo, Japan.'),(3088,'Who is a minor god of war and the older brother of Inanna patron deity of bad-tibira?','The minor god of war and the older brother of Inanna, patron deity of Bad-Tibira in Mesopotamian mythology is known as Dumuzid or Tammuz. He was associated with fertility, agriculture and shepherds, and often called the \'shepherd\'s god\'. He also had a connection to the underworld and was known as a dying and rising god.'),(3089,'Riskified provides a prevention technology, of which who