ich movie staring Madge Ryan is a musical film produced in 1963?','The movie starring Madge Ryan that is a musical film produced in 1963 is \'Summer Holiday\'.'),(3272,'Between the Psychiatric Institute of Washington and George Washington University Hospital, which hospital has been opened longer?','George Washington University Hospital has been open longer than the Psychiatric Institute of Washington. George Washington University Hospital was founded in 1824 while the Psychiatric Institute of Washington was founded in 1967.'),(3273,'When was a mountain in Antarctica named for the King of Wessex given its name?','Mount Athelstan in Antarctica was named in honor of the King of Wessex, Athelstan, by the British Antarctic Expedition of 1910-1913, led by Robert Falcon Scott. It was named on January 5, 1911, during their exploration of the region.'),(3274,'Which country has legal gambling and a lack of natural resources?','One country that fits this description is Singapore. Despite having a lack of natural resources, Singapore has a thriving gambling industry with two major casinos, the Marina Bay Sands and Resorts World Sentosa. Gambling is legal and regulated in Singapore.'),(3275,'The series MVP of the 1965 World Series was born in what year?','The series MVP of the 1965 World Series was pitcher Sandy Koufax, who was born on December 30, 1935.'),(3276,'On February 18, 2016, 71 people were killed 13 injured in a head-on collision between a bus and a truck. What was the name of the region in Ghana this took place?','The name of the region in Ghana where the head-on collision between a bus and a truck occurred on February 18, 2016 was the Kintampo North Municipal District, located in the Bono East Region.'),(3277,'What language spoken in the Philippines is derived from a language that evolved from Vulgar Latin?','The language spoken in the Philippines that is derived from a language that evolved from Vulgar Latin is Spanish. Spanish was brought to the Philippines by Spanish colonizers in the 16th century and was the official language of the country for over 300 years. Today, Spanish still has a significant influence on Filipino culture and language, especially in terms of vocabulary and grammar.'),(3278,'Do both the Spanish Water Dog and Cão da Serra de Aires originate from Turkey?','No, both the Spanish Water Dog and Cão da Serra de Aires do not originate from Turkey. \n\nThe Spanish Water Dog (Perro de Agua Español) originated in Spain, where it was bred as a working dog to assist with herding, fishing, and hunting. \n\nThe Cão da Serra de Aires, also known as the Portuguese Sheepdog, originated in Portugal, where it was bred for herding and guarding livestock in the Serra de Aires Mountains. \n\nAlthough both breeds may share some similarities in appearance and temperament, their origins are distinct and separate from Turkey.'),(3279,'When was British nationality granted to the author that wrote the book that \'The Road to Romance\' is based off? ','I apologize, but could you please provide the full name of the author you are referring to or the title of the book? This would help me in finding an accurate answer to your question.'),(3280,'The Singing Dolly performed what type of dance?','I\'m sorry I couldn\'t find any information about a dance style called \'Singing Dolly\'. Could you please provide more context or clarify your question?'),(3281,'When was the school, at which Josh Hart played basketball as a senior, founded ?','The high school at which Josh Hart played basketball as a senior is Sidwell Friends School. It was founded in 1883.'),(3282,'Rock Bay is a neighborhood that borders a city located on the south tip of what island of Canada\'s Pacific coast?','Rock Bay is a neighborhood that is located in the city of Victoria, which is situated on the southern tip of Vancouver Island, on Canada\'s Pacific coast.'),(3283,'Who beat the person that beat Wendell Anderson in the 1978 Senate election? ','In the 1978 United States Senate election in Minnesota, Wendell Anderson was defeated by Republican Rudy Boschwitz. Boschwitz went on to represent Minnesota in the Senate until 1991.'),(3284,'What Twenty20 cricketmatch featured winner Peshawar Zalmi in 2017?','The Peshawar Zalmi won the 2017 season of the Pakistan Super League (PSL) Twenty20 cricket tournament. They defeated the Quetta Gladiators in the final to become champions.'),(3285,'Which American actor, producer, and voice artist starred in \'The Great Escape\' (1963) with Steve McQueen and the 1981 American horror film The Fan?','That would be the American actor James Garner.'),(3286,'How was the man with the \'Million-Dollar Voice\' rellated to \'The Queen of Soul\'?','The man with the \'Million-Dollar Voice,\' Don LaFontaine, was not related to \'The Queen of Soul,\' Aretha Franklin. They were both successful in their respective fields, with LaFontaine being a voice actor known for his work in movie trailers and Franklin being a legendary singer and songwriter known for her soulful music.'),(3287,'Whos case did Park Dietz consult or testify in where the killer hired sex workers?','Park Dietz is a forensic psychiatrist who has consulted or testified in many high-profile criminal cases over the years. One of the cases where he testified involved the notorious serial killer Jeffrey Dahmer, who had hired sex workers before killing them. However, it is not clear if this is the specific case you are referring to.'),(3288,'Circle stars which South Korean actress?','I\'m sorry, but I am not able to understand your question. Can you please provide more context or clarify what you are asking?'),(3289,'What award did the music director Bhaskarabhatla Ravi Kumar worked with extensively win for a 2003 work?','Bhaskarabhatla Ravi Kumar was not a music director, but a lyricist in the Telugu film industry. He worked extensively with composer Devi Sri Prasad for the 2003 Telugu movie \'Varsham\' which won the Nandi Award for Best Feature Film. However, \'Varsham\' did not win any national or international award in 2003.'),(3290,'Michie Stadium is an outdoor football stadium on the campus of a U.S Military Academy which is located in what county?','Michie Stadium is an outdoor football stadium on the campus of the United States Military Academy, which is located in Orange County, New York.'),(3291,'Who was born first, Baruch Leib Rosowsky or Barney Ross?','Barney Ross was born first. He was born on December 23, 1909. Baruch Leib Rosowsky, better known as Berel Lazar, was born on October 22, 1964.'),(3292,'Of his 5 seasons coaching the Miami Hurricanes, which was Larry Coker\'s most successful?','Larry Coker\'s most successful season coaching the Miami Hurricanes was in 2001, his first season as head coach. During the 2001 season, the Hurricanes went 12-0 and won the national championship.'),(3293,'WAVE is located alongside which CBS affiliate on virtual channel 32?','WAVE is located alongside the CBS affiliate WLKY on virtual channel 32.'),(3294,'Francisco Rafael Arellano Felix is the brother of a Mexican drug trafficker and former leader of what organization?','Francisco Rafael Arellano Felix is the brother of Javier Arellano Felix, who was the leader of the Tijuana Cartel, a Mexican drug trafficking organization.'),(3295,'Who founded the college where Thomas Stanton was educated at?','Thomas Stanton, an early settler in Connecticut, was educated at Harvard College, which was founded in 1636 by the Massachusetts Bay Colony.'),(3296,'What actress played Rachel Matherson on the series Revolution and Dr Julie Burke on the seiries  Lost? Elizabeth Mitchell','Correct! Elizabeth Mitchell played both Rachel Matheson on the series Revolution and Dr. Juliet Burke on the series Lost. She is a well-known American actress who has also appeared in other popular TV shows and movies.'),(3297,'Who is the director of the horror film remake whose release coincided with the film \'When a Killer Calls\'?','I\'m sorry, but I need a specific horror film title to provide a correct answer. Could you please provide me with the name of the horror film for which you are referring to?'),(3298,'What kind of the company is the company that Knott\'s Berry Farm sued?','I\'m sorry, I do not have enough information to accurately answer your question. Can you please provide me with more context or details about the company and the lawsuit?'),(3299,'Are both Victor Hugo Halperin and Víctor Erice film directors ?','Yes, both Victor Hugo Halperin and Víctor Erice are film directors. Victor Hugo Halperin was an American film director, best known for directing the 1932 horror classic \'White Zombie\'. Víctor Erice, on the other hand, is a Spanish film director, best known for his critically acclaimed films like \'The Spirit of the Beehive\' and \'El Sur\'.'),(3300,'What library is in the state of Victoria, Australia, is located in Melbourne and has work(s) by Australian photographic artist, Ponch Hawkes\' works hung inside of it?','The library is the State Library Victoria, located in Melbourne, Australia. The library has several works by Australian photographic artist Ponch Hawkes on display.'),(3301,'Were Aleister Crowley and Heiner Müller both poets?','Yes, Aleister Crowley and Heiner Müller were both poets. Crowley was an English occultist, mystic, and writer who wrote many poems, including the famous \'Hymn to Pan,\' \'The Star Ruby,\' and \'Liber AL vel Legis.\' Müller, on the other hand, was a German playwright, essayist, and poet who wrote several plays and works of poetry, such as \'The Hamlet Machine,\' \'Germania Death in Berlin,\' and \'Petrified Forest.\''),(3302,'On what date did the event Crash Landing was based on occur?','I\'m sorry, could you provide me with more context about what event Crash Landing is based on? Is it a movie, a book or something else?'),(3303,'An American surgeon, writer, and public health researcher born in 1965 featured an investor in his book from where?','The American surgeon, writer, and public health researcher you are referring to is Dr. Atul Gawande, and the investor featured in his book is from Omaha, Nebraska. The book is called \'The Checklist Manifesto: How to Get Things Right\'.'),(3304,'Which one is the 2nd highest mountain in the Great Smoky Mountains of Tennessee and North Carolina?','The 2nd highest mountain in the Great Smoky Mountains of Tennessee and North Carolina is Mount Guyot, which stands at 6,621 feet (2,018 meters).'),(3305,'Which movie was shown on the PBS show \'American Experience\', Walt Disney or The Mystery of Matter?','Both Walt Disney and The Mystery of Matter have been featured on the PBS show \'American Experience\', but they are two separate episodes. The Walt Disney episode details the life and legacy of the famous animator and filmmaker, while The Mystery of Matter focuses on the development of modern chemistry and the discoveries of early 20th-century scientists.'),(3306,'Which team created the fictional superheroine, who along with Superman, Batman, Green Arrow as well as the new, original Wonder Woman of Earth-Two comprised The World\'s Finest Team?','The World\'s Finest Team, which included the fictional superheroine you are referring to along with Superman, Batman, Green Arrow, and the original Wonder Woman of Earth-Two, was created by DC Comics.'),(3307,'Are Isola and Masterpiece both board games?','Yes, Isola and Masterpiece are both board games. Isola is a two-player strategy game that involves moving pieces across a hexagonal board, while Masterpiece is a game where players take on the roles of art dealers and bid on and sell paintings to earn the most profit.'),(3308,'In which album, produced by Ed Banger Records, did the French electronic music duo Justice published this song (and the song\'s music video published through Kanye West)?','The song you\'re referring to is \'D.A.N.C.E.\' by Justice. It was released in 2007 as part of their album \'Cross,\' which was produced by Ed Banger Records. The music video for \'D.A.N.C.E.\' was indeed directed by Jonas & François and featured art by So-Me, and it was later reworked by Kanye West for his \'Good Life\' music video.'),(3309,'Face to Face was featured in a 1992 American superhero film directed by Tim Burton, and starring Danny DeVito as who?','Danny DeVito played the role of Oswald Cobblepot, also known as the Penguin, in the 1992 American superhero film directed by Tim Burton, titled \'Batman Returns.\' The film was a sequel to Burton\'s 1989 film \'Batman.\''),(3310,'Born October 18, 1987 this actor stared in Baywatch the american action comedy film directed by Seth Gordon and based on the television series of the same name.','The actor who was born on October 18, 1987 and starred in Baywatch is Zac Efron.'),(3311,'Who was born first, Rudolf Schwarzkogler or Jacobo Morales?','Jacobo Morales was born first, on October 4, 1934. Rudolf Schwarzkogler was born on November 13, 1940.'),(3312,'Grant Hart and Jonathan Davis are both what?','Grant Hart was a musician best known as the drummer and co-songwriter of the alternative rock band Hüsker Dü.\n\nJonathan Davis is a musician and singer known as the lead vocalist of the nu metal band Korn.'),(3313,'From July 1985 to October 1987 Jeff Phillips appeared in the role of Rum Tum Tugger in what Australian stage production?','Jeff Phillips appeared as Rum Tum Tugger in the original Australian production of the musical \'Cats\' from July 1985 to October 1987.'),(3314,'How many seasons was the program broadcast for which Linda Morris received three Primetime Emmy Awards ?','Unfortunately, I am not able to determine which program you are referring to as there are many Linda Morris in the entertainment industry who have won multiple Primetime Emmy Awards. Could you please provide more information or context?'),(3315,'Does Straw Hat Pizza or Sarpino\'s Pizzeria have headquarters only in the US?','No, both Straw Hat Pizza and Sarpino\'s Pizzeria have headquarters outside of the United States. \nStraw Hat Pizza has a headquarters in San Ramon, California, but it also has locations in Asia, Europe, and the Middle East.\nSarpino\'s Pizzeria has headquarters in Singapore, but it also has locations in other countries such as Canada, India, and the United Arab Emirates.'),(3316,'How many episodes in the  American sitcom in which Charles Kimbrough played the straight-faced anchorman Jim Dial?','Charles Kimbrough played the role of Jim Dial in the American sitcom \'Murphy Brown\' which aired for 10 seasons from 1988 to 1998. During this time, there were a total of 247 episodes.');
