t, Samsara or What Remains of Us?','Samsara took longer to shoot than What Remains of Us. Samsara was shot over a period of five years in 25 different countries, while What Remains of Us was shot over a period of two years in Tibet.'),(3324,'Demetrius McCray played college football for a university located in which US state ?','Demetrius McCray played college football for Appalachian State University, located in Boone, North Carolina.'),(3325,'What is the nickname of Intel cofounder Robert Noyce?','Robert Noyce, the co-founder of Intel, was also known as the \'Mayor of Silicon Valley.\''),(3326,'How many votes did the highest-paid Australian football player (at his peak) poll during the 1994 AFL season?','I\'m sorry, but I could not find the exact number of votes that the highest-paid Australian football player (at his peak) polled during the 1994 AFL season. However, the Brownlow Medal is awarded to the best and fairest player in the Australian Football League (AFL) and is determined by votes given by the umpires in each game. In 1994, the Brownlow Medal was won by Greg Williams of Carlton, who received 30 votes.'),(3327,'What book by Jessica Warner won praise from a fellow historian who is a University Professor of History and Art History at Columbia University, New York?','I\'m sorry, I don\'t have enough information to answer your question. Can you provide the name of the historian and more details about the book?'),(3328,'From 2005 to 2013 for what team did the current Yankee player who samples \'The Boss\' at bat into play for?','I believe the Yankee player you are referring to is Aaron Judge. He played college baseball at Fresno State from 2010 to 2013 and was then selected by the New York Yankees in the first round of the 2013 MLB draft. Therefore, he did not play for a different team from 2005 to 2013.'),(3329,'Which club did John Bailey\'s side defeat in the 1984 FA Cup Final?','John Bailey\'s side (Everton) defeated Watford in the 1984 FA Cup Final with a