and.'),(3499,'Which university has more students, the University of Arizona or the University of Memphis?','According to the latest available data, the University of Arizona had more students than the University of Memphis. As of Fall 2020, the University of Arizona had a total enrollment of 45,801 students, while the University of Memphis had a total enrollment of 21,458 students.'),(3500,'when was the seventh studio album by American rock band Queens of the Stone Age which  \'The Way You Used to Do\' is the first single of released ','The seventh studio album by Queens of the Stone Age, \'Villains,\' was released on August 25, 2017. \'The Way You Used to Do\' was the first single released from the album.'),(3501,'What genre of film do both Thin and Iran belong to?','I apologize, but I am not familiar with any films titled \'Thin\' or \'Iran.\' Could you please provide more information or clarify your question?'),(3502,'The use of slavery expanded in the mid-nineteenth century as British-Americans such as who settled in Texas?','In the mid-nineteenth century, British-Americans did not settle in Texas. However, there was a significant influx of American settlers to Texas in the 1830s and 1840s, many of whom brought slaves with them or acquired them after arriving. Texas became an independent republic in 1836 and was later annexed by the United States in 1845, becoming a slave state. Slavery continued to expand in Texas as the cotton economy developed and demand for labor increased.'),(3503,'What U.S. Congressman from Illinois went on to create a committee to investigate sexual assault in the United States Air Force Academy?','The U.S. Congressman from Illinois who created a committee to investigate sexual assault in the United States Air Force Academy was Representative Jo Ann Davis. She created the subcommittee on Oversight and Investigations of the House Armed Services Committee for this purpose in 2003.'),(3504,'Which univeristy was established first, Texas Christian University or University of Pittsburgh?','The University of Pittsburgh was established first in 1787, while Texas Christian University was established in 1873.'),(3505,'Which lead singer is also a producer, Chester Bennington or Paul Meany?','Paul Meany is both a lead singer and a producer. He is the lead singer of the band Mutemath and is also the producer of their music. Chester Bennington, on the other hand, was the lead singer of Linkin Park, but he was not a producer of their music.'),(3506,'Which team had a player get drafted to the Texas Rangers and competes in the Big 12 Conference?','The team you are looking for is Texas Tech Red Raiders.'),(3507,'What singer who gained worldwide fame as a member of the Bee Gees helped to write \'To Love Somebody?\'','That singer is named Barry Gibb. He wrote \'To Love Somebody\' along with his brothers Robin and Maurice Gibb.'),(3508,'Do Morningwood and Sum 41 come from the same country?','Yes, Morningwood and Sum 41 are both from Canada. Morningwood formed in New York City, but their lead singer, Chantal Claret, is originally from Canada. Sum 41 was formed in Ajax, Ontario, Canada in 1996.'),(3509,'What show does the man born on February 25, 1951 host with Mark Thompson?','The man born on February 25, 1951 is Bob Saget and he used to host \'The Bob & Mark Show\' with Mark Thompson.'),(3510,'Are the Pumi and Mountain Cur both examples of lap dogs?','No, the Pumi and Mountain Cur are not lap dogs. The Pumi is a Hungarian herding breed and the Mountain Cur is a hunting breed from the United States. Both breeds are active and have high energy levels, and may not be suitable for lap sitting or apartment living.'),(3511,'Which animated series include songs like \'The Wonderful Thing about Tiggers\' and features a character named Tigger?','The animated series that features a character named Tigger and includes songs like \'The Wonderful Thing about Tiggers\' is \'Winnie the Pooh\'. Tigger is a bouncy, energetic and optimistic tiger character who loves to sing and dance.'),(3512,'What single by American rapper The Game is a tribute to the victim of a well-known police shooting that occured on August 9 , 2014, in Ferguson, Missouri, a northern suburb of St. Louis?','The single by American rapper The Game that is a tribute to the victim of a well-known police shooting that occurred on August 9, 2014, in Ferguson, Missouri, is called \'Don\'t Shoot.\' The song features several other popular hip-hop artists and addresses issues of police brutality and racism in America.'),(3513,'Alethea Talbot (1585-1654), married what prominent English courtier, who was born on July 7, 1586?','Alethea Talbot (1585-1654) married Thomas Howard, 21st Earl of Arundel, who was born on July 7, 1586.'),(3514,'What  two-time American League (AL) Most Valuable Player (MVP) award winner, a four-time AL batting champion, and an eleven-time MLB All-Star is on the cover of MLB 14: The Show?','The player on the cover of MLB 14: The Show is Miguel Cabrera.'),(3515,'What is the name of the first Chairman of the joint Chiefs of Staff and on whose name 12th A=rmy group of FUSAG given a fictitious role?','The first Chairman of the Joint Chiefs of Staff was Admiral William D. Leahy. The 12th Army Group of FUSAG was given a fictitious role under the name of General George S. Patton.'),(3516,'The actress who played Avery Jennings in Disney Channel\'s \'Dog with a Blog\' had recurring roles in which other two Disney Channel series?','The actress who played Avery Jennings in Disney Channel\'s \'Dog with a Blog\' is named G. Hannelius. She had recurring roles in two other Disney Channel series: she played Jo in \'Good Luck Charlie\' and Mad Mack in \'I Didn\'t Do It.\''),(3517,'John Blanche is an inllustrator for a magazine that has served as a promotion for what? ','John Blanche is a British illustrator who has worked on various projects throughout his career, including as a cover artist and illustrator for Games Workshop\'s magazines, such as White Dwarf, which serves as a promotional magazine for the company\'s tabletop war games, such as Warhammer and Warhammer 40,000.'),(3518,'What company formed in 1970 in Syracuse, New York by Robert J. Congel owns Crossgates Commons?','The company that formed in 1970 in Syracuse, New York by Robert J. Congel that owns Crossgates Commons is Pyramid Management Group.'),(3519,'Where was the movie filmed that was directed by the 2014 Man Booker Prize winner that was entered into the 48th Berlin International Film Festival?','I assume you are referring to the movie \'The White Tiger\' which was directed by Ramin Bahrani, who won the Man Booker Prize in 2014. The movie was actually not entered into the 48th Berlin International Film Festival, but rather it premiered on Netflix in January 2021. The film was shot in locations across India, including Delhi, Agra, and Bangalore.'),(3520,'Jordan Allen-Dutton is best known for his writing on an American stop motion sketch comedy television series, created and executive produced for who?','Jordan Allen-Dutton is best known for his writing on the American stop-motion sketch comedy television series \'Robot Chicken,\' which was created and executive produced by Seth Green and Matthew Senreich.'),(3521,'What American mass murderer shared a presiding judge with John Wayne Gacy?','The American mass murderer who shared a presiding judge with John Wayne Gacy is Richard Ramirez, also known as the \'Night Stalker.\' Both Ramirez and Gacy were tried by Judge Michael A. Getty in Cook County, Illinois.'),(3522,'Which Chinese family owns the majority of Lippo Limited and it\'s subsidiary Hongkong Chinese Limited?','The Lippo Group is owned by the Riady family, who are Indonesian-Chinese. The group\'s main holding company is Lippo Limited, and its subsidiary in Hong Kong is called Lippo China Resources, which was formerly known as Hongkong Chinese Limited.'),(3523,'Who has more scope of profession, Tom Robinson or Glenn Richards?','I\'m sorry, but I need more information to answer your question. Tom Robinson and Glenn Richards could be anyone, so I need to know their backgrounds, education, and experience to evaluate their scope of profession. Please provide more details.'),(3524,'The Quaid-i-Azam University and the University of Patras are both what types of universities?','Quaid-i-Azam University is a public research university, located in Islamabad, Pakistan, while the University of Patras is a public research university located in Patras, Greece. Both universities are categorized as public universities and are known for their strong research programs.'),(3525,'What European state meeting started with a Coalition Ally meeting, and was chaired by Klemens von Metternich?','The European state meeting that started with a Coalition Ally meeting and was chaired by Klemens von Metternich was the Congress of Vienna, which took place in 1815 to redraw the map of Europe after the defeat of Napoleon Bonaparte. Metternich was an influential diplomat who played a key role in shaping the balance of power in Europe during this time.'),(3526,'Which cycle of \'America\'s Next Top Model\' did the current \'The Look for Less\' host win?','Kathleen Alcala, the current host of \'The Look for Less\', didn\'t win any cycle of \'America\'s Next Top Model.\' In fact, she never competed in the show. It\'s possible you may be thinking of a different host or show. Let me know if you have any other questions!'),(3527,'Are both Milwaukee School of Engineering and University of Jordan located in Wisconsin?','No, Milwaukee School of Engineering is located in Milwaukee, Wisconsin, USA while University of Jordan is located in Amman, Jordan.'),(3528,'Which former senior Argentine police officer did Miguel Etchecolatz testify against in regards to the Dirty War?','Miguel Etchecolatz testified against former senior Argentine police officer, Julio Simon, in regards to the Dirty War. Simon was convicted of crimes against 