ng the Lumière Factory is often referred to as the first motion picture ever made. It was produced by Auguste and Louis Lumière and was publicly screened on December 28, 1895 in Paris, France.'),(3630,'What was the proposed name of an alleged new element that was actually an incorrect sample as determined by an English chemist born in 1832?','The proposed name of the alleged new element was \'viresium\' and the English chemist who determined it was actually an incorrect sample was Henry Enfield Roscoe.'),(3631,'Which capital city is among one of the stops on the Jean Monnet express train?','The Jean Monnet Express train is a special train service connecting several European capital cities, and several cities have been included on its itinerary over the years. However, as the route and stops of the train was subject to change, it\'s difficult to determine which specific city was among the stops on the train without additional information regarding the time period in question.'),(3632,'What is the low floor tram built by Swiss manufacturer of railway rolling stock?','The low floor tram built by a Swiss manufacturer of railway rolling stock is called the \'Cobra\' tram. It is manufactured by a company called Stadler Rail and has been in use in several cities around the world. The Cobra tram is characterized by its low floor design which makes it easier for passengers to board and exit the tram, especially for those with mobility issues.'),(3633,'What band member of a group who founded Apple Corp, informed the other members he was leaving the group in 1969?','The band member who left the Beatles and informed the other members in 1969 was Paul McCartney.'),(3634,'What century was this colony founded whose origins are detailed in the Icelandic Saga, Játvarðar Saga?','The colony described in Játvarðar Saga is believed to have been founded in the 10th century, which would correspond to the Viking Age. The saga describes the settlement of an area in North America known as Vi