h the Italian-American pro boxer who won the world championship in what two divisions?','Angelo Dundee worked with Muhammad Ali (formerly known as Cassius Clay) and helped him win the world championship in both the heavyweight and light heavyweight divisions.'),(3949,'Who directed the film for which Jim Lemley is best known?','Jim Lemley is a film producer, and he is best known for producing the movie \'300.\' The movie was directed by Zack Snyder.'),(3950,'about 15 mi east of Reno is a brothel once owned by who?','The brothel you are referring to is the Mustang Ranch, which was once owned by Joe Conforte.'),(3951,'Are both Claude Lanzmann and Polly Draper French?','No, only Claude Lanzmann is French. Polly Draper is an American actress, writer, producer, and director.'),(3952,'What team, that plays in Madison Square Garden, drafted Lonnie Shelton?','The New York Knicks drafted Lonnie Shelton in the first round of the 1976 NBA Draft. The Knicks play their home games at Madison Square Garden.'),(3953,'What network did the episode \'I Wed Three Wives\' air on?','\'I Wed Three Wives\' is an episode from the popular American television series titled \'I Love Lucy.\' It originally aired on CBS network on October 5, 1953.'),(3954,'Are both operas, Vanessa and Káťa Kabanová, by the same composer ?','No, Vanessa was composed by Samuel Barber and Káťa Kabanová was composed by Leoš Janáček.'),(3955,'Which opera has more acts, Elegy for Young Lovers or Prince Igor?','Prince Igor has more acts than Elegy for Young Lovers. Prince Igor is a four-act opera composed by Alexander Borodin, while Elegy for Young Lovers is a three-act opera composed by Hans Werner Henze.'),(3956,'Are Pinanga and Convolvulus in the same family?','No, Pinanga and Convolvulus are not in the same family. Pinanga is a genus of palms in the family Arecaceae, while Convolvulus is a genus of flowering plants in the family Convolvulaceae.'),(3957,'What partner of Richard Herring co-wrote Jerry Springer: The Opera?','Stewart Lee co-wrote Jerry Springer: The Opera with Richard Herring.'),(3958,'The author of a book written on how consciousness arises from interaction of physical and cognitive processes in the brain also wrote a book on free will and moral responsibility published in what year?','The author you are referring to is most likely Michael S. Gazzaniga, and his book on free will and moral responsibility is titled \'Who\'s in Charge?: Free Will and the Science of the Brain\'. It was published in 2011.'),(3959,'What type of artist does Mr. Short Khop and Ice Cube have in common?','Mr. Short Khop and Ice Cube are both rappers and hip-hop artists.'),(3960,'What was the birth name of the general who conducted the Columbus Raid?','The general who conducted the Columbus Raid was named Pancho Villa. However, Pancho Villa was a well-known revolutionary and bandit who was not part of the military. The leader of the American Expeditionary Force that pursued Villa after the raid was General John J. Pershing.'),(3961,'Was Winnie the Pooh written by Frank Oz or Plan B','Winnie the Pooh was not written by either Frank Oz or Plan B. The original stories of Winnie the Pooh were written by British author A.A. Milne in the 1920s. The character of Winnie the Pooh was inspired by a teddy bear owned by Milne\'s son Christopher Robin.'),(3962,'Which musical artist had their start on the television series \'Victorious,\' Elizabeth Gillies or Imagine Dragons?','Elizabeth Gillies had her start on the television series \'Victorious\'. Imagine Dragons is an American rock band, they did not have their start on the TV show \'Victorious\'.'),(3963,'Who portrayed Ash Williams in the series in which, Jill Marie Jones portrayed Amanda Fisher ? ','Bruce Campbell portrayed Ash Williams in the series, while Jill Marie Jones portrayed Amanda Fisher in the show \'Ash vs Evil Dead.\''),(3964,'Who is designated as the \'Godfather of Punk\', Patrick Monahan or Iggy Pop?','Iggy Pop is commonly designated a