equest as evidence of Shakespeare\'s disregard for his wife, while others believe that it was a gesture of love and affection, since the second best bed was traditionally the marital bed. However, it is also important to note that the second best bed was not the only bequest in the will; Shakespeare also left substantial sums of money and property to his daughters and other family members.'),(3977,'Funcom has developed which massive multiplayer game with a lead developer of Ragnar Tørnquist?','Funcom has developed \'The Secret World\' with Ragnar Tørnquist as a lead developer. It was a massively multiplayer online role-playing game that focused on modern-day myths and legends. The game was released in 2012 and was rebranded as \'Secret World Legends\' in 2017.'),(3978,'Where is the homestead located that is built at the foot of the Wonga hill?','I\'m sorry, but I cannot answer your question without more context. Could you provide additional information about the homestead you are referring to?'),(3979,'Which pitcher played for both the Toronto Blue Jays and the Houston Astros?','The pitcher who played for both the Toronto Blue Jays and the Houston Astros is JA Happ. He played for the Blue Jays from 2012 to 2014 and for the Astros for a brief stint in 2010.'),(3980,'From which Real Madrid captain does Kalle Mäkinen get his nickname?','Kalle Mäkinen\'s nickname \'Santillana\' is derived from the former Real Madrid captain and striker, Carlos Alonso González, who was known as \'Santillana\'. The Finnish journalist was given this moniker because of his admiration for the Spanish football legend.'),(3981,'Which IMG Worlds of Adventure epic zone is a wholly owned subsidiary of The Walt Disney Company?','None of the epic zones in IMG Worlds of Adventure are owned by The Walt Disney Company. The park is owned by the Ilyas and Mustafa Galadari (IMG) Group. However, the park does have licensing agreements with major entertainment companies including Cartoon Network, Marvel, and Warner Bros.'),(3982,'The Courtland pocket, which refers to the Red Army\'s isolation of Axis Forces on the Courtland Peninsula from 1944-1945, held a civilian occupation regime in which Baltic States? ','The Courtland Pocket, also known as the Courland Cauldron, was an isolated pocket of German and Latvian forces on the Courland Peninsula in Western Latvia. The civilian occupation regime in the Baltic States did not include the Courland Pocket, as it was a military conflict zone during World War II. The occupation regime was implemented in Estonia, Latvia, and Lithuania by the Soviet Union between 1940–1941 and again between 1944–1991.'),(3983,'What position did Judith Maltby hold at Corpus Christi that denotes any appointment for a senior academic in the United Kingdom?','Judith Maltby is the Chaplain and Fellow of Corpus Christi College, Oxford. \'Fellow\' is a term used in the United Kingdom to denote a senior academic position at a college or university.'),(3984,'Who was a kinsman of one of the last Anglo-Saxon kings of England?','One of the last Anglo-Saxon kings of England was King Harold II (also known as Harold Godwinson). One of his kinsmen was his brother Tostig Godwinson, who was an earl and also briefly rebelled against Harold before seeking refuge with the Norwegian King Harald Hardrada.'),(3985,'Were the decisions in the cases Henderson v. United States and Marsh v. Chambers given in the same year ?','No, the decisions in Henderson v. United States and Marsh v. Chambers were not given in the same year. \n\nHenderson v. United States was a case decided by the United States Supreme Court in 2020, whereas Marsh v. Chambers was a case decided by the Supreme Court in 1983.'),(3986,'What is the mission of the college that is located in Kiowa County that, as of 2010, had a population of 701?','I\'m sorry, but I would need more information to accurately answer your question. Can you please provide the name of the college and the state or country where it i