 Diritto Municipale, which is a legal text that outlines the rights and responsibilities of people living in these municipal corporations, was a response to this need. It was written in the early thirteenth century and had a significant impact on the development of municipal law in Italy and throughout Europe.'),(4009,'Graft, Netherlands is part of a municipality known for what food?','The municipality of Graft-De Rijp is known for its cheese production, particularly for its Gouda cheese. The area has a rich tradition of cheese making, and there are still many cheese farms and shops in the region.'),(4010,'Teresa Kubiak is best known for her recording of the role of Tatyana in an opera which very closely follows certian passages in whose novel?','Teresa Kubiak is best known for her recording of the role of Tatyana in Pyotr Ilyich Tchaikovsky\'s opera \'Eugene Onegin,\' which is based on Alexander Pushkin\'s novel of the same name.'),(4011,'Union Carbide is owned by the multinational corporation headquartered where?','Union Carbide was owned by the multinational corporation Dow Chemical, which is headquartered in Midland, Michigan, in the United States. However, Union Carbide was originally headquartered in Danbury, Connecticut but was acquired by Dow Chemical in 2001.'),(4012,'In between Seed and Motor Trend which one is for automobile?','Both Seed and Motor Trend are automobile-related publications. However, Motor Trend has a specific focus on cars, trucks, and other vehicles, while Seed includes articles about a wide variety of topics, beyond just automobiles.'),(4013,'Lake Bell had a starring role in the 2014 sports film directed by whom?','Lake Bell had a starring role in the 2014 sports comedy-drama film \'Million Dollar Arm,\' which was directed by Craig Gillespie.'),(4014,'Who was born first Jerry Cantrell or Frank Turner?','Jerry Cantrell was born on March 18, 1966, and Frank Turner was born on December 28, 1981. Therefore, Jerry Cantrell was born first.'),(