odes, which were aired from 1991 to 1999.'),(4578,'Are the University of Delaware and Center for Advanced Studies in Engineering (CASE) both privately governed universities?','The University of Delaware (UD) is a public university, meaning it is overseen by the state government of Delaware and receives funding from the state. The Center for Advanced Studies in Engineering (CASE) is a private institution that operates in partnership with UD. Although CASE works closely with UD and many of its programs are collaborative efforts, it is a separate organization and not governed by the state.'),(4579,'Which American stand-up comedian, actor, musician, and author is Why Is There Air? his third album','The American stand-up comedian, actor, musician, and author who released his third comedy album Why Is There Air? is Bill Cosby. He released the album in 1965.'),(4580,'Tron Lightcycle Power Run is what type of roller coaster, that uses a series of linear induction motors?','Tron Lightcycle Power Run is a launched roller coaster that uses a series of linear induction motors. These magnets propel the riders, representing the Tron characters, through the ride at high speeds, simulating a futuristic motorcycle race.'),(4581,'When was the last song of the last species of birds of the Mohoidae family heard?','The last known recording of the Moho braccatus, or the Kaua\'i \'O\'o, was made on December 11, 1987. The bird was last seen on January 26, 1987, and is believed to have gone extinct soon after due to habitat loss and disease. It was one of the last surviving species of the Mohoidae family.'),(4582,'What kind of plant does Arisarum and Edithcolea have in common?','Arisarum and Edithcolea both belong to the family Araceae, which is a family of flowering plants commonly known as the arum or aroid family. Both Arisarum and Edithcolea are genera within this family and they share similar characteristics such as tuberous roots, simple leaves and small, inconspicuous flowers.'),(458