 and the Delaware and Hudson Canal were not opened within a decade of each other. The Louisville and Portland Canal, which connected the Ohio River to the city of Louisville, was completed in 1830. The Delaware and Hudson Canal, which connected coal mines in Pennsylvania to the Hudson River, was completed in 1828. So, they were opened within two years of each other.'),(4702,'Which musician, Billy Gibbons and Milo Aukerman, is a former research biochemist?','Milo Aukerman is a former research biochemist.'),(4703,'Michael Sleavon was born in a county that covers how many km² ?','I\'m sorry, I do not have any information about who Michael Sleavon is or the county he was born in. Could you please provide more context or details?'),(4704,'John O\'Brien was a hostage during which crisis in 2014 that happened at the Lindt Cafe in Sydney, Australia?','John O\'Brien was not a hostage during the 2014 Lindt Cafe siege in Sydney, Australia. The two hostages who lost their lives during the siege were Tori Johnson and Katrina Dawson. The siege lasted for 16 hours and ended on December 16, 2014.'),(4705,'Robert Epstein was editor in chief of a magazine that is published how often?','Robert Epstein is an American psychologist and author, so I\'m not sure which magazine you are referring to. However, he was the editor-in-chief of Psychology Today magazine from 2003 to 2008, which is published every two months.'),(4706,'Besides the 1992 comedy horror film, Marshall Bell also stars in which 1990 action film?','Marshall Bell also starred in the 1990 action film \'Total Recall,\' alongside Arnold Schwarzenegger.'),(4707,' Delicious is the second EP by a dubstep artist born in which year ?','I\'m sorry, but your question lacks crucial information for me to provide a helpful answer. Can you please provide me the name of the dubstep artist you are referring to so I can better assist you?'),(4708,'When was the person born who wrote the music and lyrics for the Dirty Rotten Scoundrels ?','Th