7,'The Mortal Instruments: City of Bones stars what actor who was born in 1961?','The Mortal Instruments: City of Bones stars actor Aidan Turner who was actually born in 1983. I believe you might have mistaken him with another actor who was born in 1961. It\'s possible that you were looking for the name of actor Jeremy Irons, who starred in the film alongside Aidan Turner.'),(4878,'are the species comprising Gleditsia and Neomarica found in the same locations?','Gleditsia and Neomarica are not typically found in the same locations. \n\nGleditsia, commonly known as honey locust, is a genus of trees and shrubs native to eastern and central North America, as well as in South America. They are commonly found in open forests, meadows, and along streams.\n\nNeomarica, commonly known as apostle plant or walking iris, is a genus of flowering plants native to Central and South America. They are found in a variety of habitats including rainforests, savannas, and disturbed areas, often growing as epiphytes or on rocky cliffs. \n\nSo, while there may be some overlap in their ranges, the two genera are not typically found in the same locations.'),(4879,'Where is the TV show produced that has an episode titled \'Moral Midgetry\'?','The TV show with an episode titled \'Moral Midgetry\' is \'The Wire\'. It was produced in the United States by HBO and aired from 2002 to 2008.'),(4880,'Where are the global headquarters of the company who released Fragmen?','I apologize but I do not have enough information about \'Fragmen\' as there are several companies or products that may have this name. Can you please provide me with more context or details about the company or product you are referring to?'),(4881,'How long was the win streak that the fighter who would famously lose to Jake Rosholt when he lost to Anderson Silva?','The fighter who would famously lose to Jake Rosholt when he lost to Anderson Silva is Rich Franklin. He had a win streak of seven fights before losing to Anderson Silv