anas, also known as pineapple, is native to South America, specifically Brazil and Paraguay. Aruncus, also known as goat\'s beard, is native to North America and Eurasia.'),(4901,'When did Tahitians first begin settling the islands hit by Hurricane Dot in 1959?','Tahitians first began settling the islands hit by Hurricane Dot in 850 AD. The islands were likely discovered and settled by Polynesians who migrated from nearby islands, possibly including Tahiti.'),(4902,'Which collaborator of the song \'Little Boy\' was convicted for murder in the 2000s?','The collaborator of the song \'Little Boy\' who was convicted for murder in the 2000s was producer and rapper Chauncey \'Hit-Boy\' Hollis\' father, Chauncey Hollis Sr. He was convicted of second-degree murder in 2007 and sentenced to 54 years to life in prison.'),(4903,'What city was the series that made Alessandra Mastronardi famous set in?','Alessandra Mastronardi became famous for her role as Francesca Johnson in the Italian TV series \'I Cesaroni,\' which is set in Rome. However, she also gained international recognition for her role as Francesca in the Netflix series \'Master of None,\' which is set in New York City.'),(4904,'In what film would one find the man also known as \'Hung Kam-bo\' as both the star and director in its sixth film in the series?','The man known as \'Hung Kam-bo\' is Jackie Chan and the film series is \'Police Story.\' He starred and directed the sixth film in the series, \'Police Story 6: Lockdown.\''),(4905,'Are Stephen Hopkins and Kingsley Ogoro from different countries?','Yes, Stephen Hopkins and Kingsley Ogoro are from different countries. Stephen Hopkins is an American film director, while Kingsley Ogoro is a Nigerian film director.'),(4906,'They Flew Alone was about an aviator with what claim to fame?','\'They Flew Alone\' is a 1942 film based on the life of British aviator Amy Johnson. Johnson became famous in 1930 when she became the first woman to fly solo from Britain to Australia. The film tells the story of her life and achievements in aviation, as well as her personal struggles and tragic death at a young age.'),(4907,'This heavy metal band\'s second studio album, and consequent 2001-2002 tour, was named after their home state.','The heavy metal band you are referring to is Slipknot, and the album is titled \'Iowa\'.'),(4908,'Who has a wider scope of profession, Ken Kesey or Elizabeth Forsythe Hailey?','It is difficult to determine who has a wider scope of profession, as both Ken Kesey and Elizabeth Forsythe Hailey have had diverse and successful careers in their respective fields. Ken Kesey was primarily known as a novelist, but he was also an essayist, poet, and playwright. Additionally, he was a key figure in the countercultural movement of the 1960s and was involved in experimental theater and film. Elizabeth Forsythe Hailey, on the other hand, is a novelist, screenwriter, and playwright, known for her works in various genres including drama, romance, and suspense. Ultimately, both authors have had impactful careers and their works have resonated with readers across generations.'),(4909,'What took place in Westminster Abbey in 2011 and contained a wedding dress designed by Sarah Burton?','The event that took place in Westminster Abbey in 2011 and contained a wedding dress designed by Sarah Burton was the royal wedding of Prince William, Duke of Cambridge and Catherine Middleton, now known as the Duke and Duchess of Cambridge.'),(4910,'Edge of the World is an album created by a guitarist who has won what award?','The album \'Edge of the World\' was created by the guitarist Eric Johnson, who won a Grammy Award for his instrumental performance \'Cliffs of Dover\' in 1991.'),(4911,'Market Garden Brewery, along with what first brewpub in Cleveland, is part of the Brewing district?','The Market Garden Brewery is one of the brewpubs in the Ohio City neighborhood of Cleveland, which is known as the brewing district. The first brewpub in Cleve