 the Republican primary for 2012 by the Representative from which Missouri congressional district?','Sarah Steelman was defeated in the Republican primary for the 2012 Missouri Senate race by Todd Akin, who was the Representative for Missouri\'s 2nd congressional district at the time.'),(5172,'Khancoban Dam is part of what south-east Australian irrigation complex?','Khancoban Dam is part of the Murray-Darling Basin irrigation complex. The Murray-Darling Basin is a large agricultural area in southeastern Australia that spans across New South Wales, Victoria, and Queensland, and is known for its extensive network of dams, weirs, and channels that supply water for irrigation.'),(5173,'When did the King reign who Shin Ditha Pamauk met with in 1287?','The King who Shin Ditha Pamauk met with in 1287 is King Narathihapate of the Pagan Dynasty in Myanmar (Burma).'),(5174,'Heard Well was founded by an American youtuber, entrepreneur, entertainer, and writer who was born in what year?','Well, \'Heard Well\' was actually founded by Connor Franta, who is an American YouTuber, entrepreneur, and writer. He was born on September 12, 1992.'),(5175,'In their original form, was Old Dominion University, in Virginia, or the University of Michigan founded first?','The University of Michigan was founded first. It was established in 1817, while Old Dominion University was founded much later in 1930.'),(5176,'Which school has more students, University of Richmond or Virginia Commonwealth University?','As of Fall 2020, Virginia Commonwealth University had more students with a total enrollment of 30,165 students while the University of Richmond has an enrollment of 4,002 students.'),(5177,'Which game is older, Snakes and Ladders or Hey Pa! There\'s a Goat on the Roof?','Snakes and Ladders is the older game, with origins dating back to ancient India. Hey Pa! There\'s a Goat on the Roof was created in the mid-20th century by game designer Sid Sackson.'),(5178,'In what county is the schoool The