ely based on the novel \'The Three Musketeers\' by Alexandre Dumas.'),(5306,'Rajwali Shah Khattak is a poet in a language spoken by approximately how many people worldwide ?','Rajwali Shah Khattak is a poet in the Pashto language. The Pashto language is spoken by approximately 50 million people worldwide, mainly in Afghanistan and Pakistan.'),(5307,'Which mountain has a greater elevation, Momhil Sar or Sunanda Devi?','MOMHIL SAR has a greater elevation with a height of 7,338 meters compared to Sunanda Devi which has a height of 7,434 meters.'),(5308,'What is the theme of the amusement park where the first dive coaster manufactured by B&M that doesn\'t feature a turn between the lift hill and the first drop can be found?','The amusement park you are referring to is called Carowinds and the theme of the park is the Carolina region, specifically celebrating the culture of both North and South Carolina. The B&M dive coaster you are referring to is called \'Fury 325\' and it is one of the park\'s most popular attractions.'),(5309,'Has Starset or The Alarm existed longer in the Rock Music scene?','The Alarm has been around longer than Starset in the rock music scene. The Alarm was formed in 1981, while Starset was formed in 2013.'),(5310,'There are numerous people who contributed to MadeinTYO\'s debut mixtape \'You Are Forgiven.\' Of those contributors, which one produces for 808 Mafia?','The producer who contributes to \'You Are Forgiven\' and also produces for 808 Mafia is MexikoDro.'),(5311,'What boy band was a man from Tennessee who made a guest appearance on Magna Carta Holy Grail part of?','The man from Tennessee who made a guest appearance on Magna Carta Holy Grail is Justin Timberlake. He was a member of the boy band *NSYNC.'),(5312,'The Pulaski bridge in New York City crosses a creek which is a tributary of which river?','The Pulaski Bridge in New York City crosses Newton Creek, which is a tributary of the East River.'),(5313,'Which has more species, Drimys or Zi