ich World Series?','The American former Major League Baseball player who came to the Padres in 1973 and had the winning hit in a World Series is Joe Morgan. He hit the winning single in Game 7 of the 1975 World Series while playing for the Cincinnati Reds.'),(5333,'Miyazaki Prefectural Art Museum displays wors by what Swiss-German artist associated with the Bauhaus school?','The Miyazaki Prefectural Art Museum displays works by the Swiss-German artist Paul Klee, who was associated with the Bauhaus school.'),(5334,'Were Andrey Markov and Nikolai Lobachevsky contemporaries?','Yes, Andrey Markov and Nikolai Lobachevsky were contemporaries, as they were both born in the 18th century and lived in Russia. Lobachevsky was born in 1792 and died in 1856, while Markov was born in 1856 and died in 1922. Lobachevsky is known for his contributions to non-Euclidean geometry and Markov is known for his work in probability theory, particularly in the development of the theory of Markov chains.'),(5335,'Are Bridegroom and How to Change the World both documentaries ?','Yes, both \'Bridegroom\' and \'How to Change the World\' are documentaries. \'Bridegroom\' is a documentary about the struggles and discrimination faced by homosexuals, and \'How to Change the World\' is a documentary about the early days of the environmental organization Greenpeace.'),(5336,'Which patient of Henry Victor Dicks\' was appointed Deputy Führer to Adolf Hitler in 1933?','The patient of Henry Victor Dicks who was appointed Deputy Führer to Adolf Hitler in 1933 was Rudolf Hess. Rudolf Hess was a devoted follower of Adolf Hitler and played a key role in the Nazi Party before his flight to Scotland in 1941.'),(5337,'What Beatles album contains the song Rocket Raccoon is referencing?','Rocket Raccoon is a fictional character from Marvel Comics, and as far as I know, he doesn\'t reference any Beatles album. However, to answer your question, The Beatles have released many albums during their career. Could you ple