own for his zany characters and impressions, while Lewis was known for his physical comedy and slapstick humor. They also both appeared in numerous films and television shows throughout their careers.'),(5389,'Where are The Cairo and Dupont Circle located?','The Cairo is a historic building located at 1615 Q St NW in Washington D.C., United States. Dupont Circle is a trendy neighborhood in Washington D.C. centered around the traffic circle of the same name, located at the intersection of Massachusetts Avenue NW, Connecticut Avenue NW, New Hampshire Avenue NW, P Street NW, and 19th Street NW.'),(5390,'Who created the virtual band that has been backed up in live shows by Demon Strings?','The virtual band that has been backed up in live shows by Demon Strings is called Gorillaz. Gorillaz was created by British musician Damon Albarn and artist Jamie Hewlett in 1998.'),(5391,'Wrong Side of Heaven is a single by what heavy metal band that was formed in 2005, and comes from Las Vegas, Nevada?','\'Wrong Side of Heaven\' is a single by the heavy metal band Five Finger Death Punch, which was formed in 2005 and comes from Las Vegas, Nevada.'),(5392,'Prince Hisahito of Akishino is the youngest child and only son of which member of the Japanese imperial family born on November 30, 1965?','Prince Hisahito of Akishino is the youngest child and only son of Prince Fumihito (Akishino) and Princess Kiko of Japan, born on November 30, 2006.'),(5393,'Which public official, born on November, 7, 1952, gave several reports on the state of Iraq?','The public official born on November 7, 1952, who gave several reports on the state of Iraq, is former United States Secretary of State, Condoleezza Rice.'),(5394,'When did the defeat of the Labor Party and the passage of amendments to the \'Marriage Act 1961\' occur?','The defeat of the Labor Party and the passage of amendments to the Marriage Act 1961 occurred in December 2017, when the Australian Parliament voted to legalize same-sex marriage. The amendments were signed into law by the Governor-General on December 8, 2017, and same-sex couples were able to legally marry starting on December 9, 2017.'),(5395,'Who is the founder of this empire later ruled by the emperor whose rule was recorded in the Rabatak inscription?','The empire referred to in the Rabatak inscription is the Kushan Empire which existed between the 1st and 4th century CE in central and northern South Asia. The founder of the Kushan Empire is believed to be Kujula Kadphises who united various tribes in the region and established his rule around 30-40 CE. However, his reign is not mentioned in the Rabatak inscription. The inscription records the reign of Kanishka I, who was one of the most important rulers of the Kushan Empire and who ruled from around 127-150 CE.'),(5396,'Who lives at a hotel operated by Caesars Entertainment Corporation and is a magician?','One famous magician who lived at a Caesars Entertainment Corporation hotel in Las Vegas is David Copperfield. Copperfield has performed at the MGM Grand, a hotel owned and operated by Caesars Entertainment.'),(5397,'Which press secretary served under two different presidents and has a Communication Center named after him?','The press secretary who served under two different presidents and has a Communication Center named after him is Marlin Fitzwater. He served as press secretary for both Ronald Reagan and George H.W. Bush, and the Communication Center at the George Washington University is named after him.'),(5398,'Which Wake Forest doctor is known for his work in regenerative medicine?','Dr. Anthony Atala, director of the Wake Forest Institute for Regenerative Medicine, is known for his groundbreaking work in regenerative medicine. He has been a pioneer in the field of tissue engineering and has developed methods for growing replacement organs and tissues in the lab using a patient\'s own cells.'),(5399,'What was the original name of the group that played \'The One Thing\'?','The original name of the group that played \'The One Thing\' is INXS.'),(5400,'What is the capital of the U.S. state of North Dakota?','The capital of North Dakota is Bismarck.'),(5401,'Did Joe Strummer and Mikael Stanne both perform in metal bands?','Joe Strummer was not known for performing in metal bands. He was the lead vocalist and guitarist of the punk rock band The Clash. \n\nMikael Stanne, on the other hand, is the lead vocalist of the Swedish melodic death metal band, Dark Tranquillity, which he joined in 1994.'),(5402,'Buck Rogers: Countdown to Doomsday is set in a game setting created in what decade?','Buck Rogers: Countdown to Doomsday is set in a game setting created in the 1980s. The game was originally released in 1990, but it was based on the classic sci-fi character and setting that was popular in the 1980s.'),(5403,'The first novel by a black West Indian to be published in England was written by which Afro-Trinidadian historian, journalist, and socialist?','The first novel by a black West Indian to be published in England was \'The Lonely Londoners\' by Samuel Selvon, who was an Afro-Trinidadian historian, journalist, and socialist.'),(5404,'Squamscott River lies in a county with what population as of the 2010 census?','The Squamscott River runs through several towns in two counties in New Hampshire - Rockingham and Strafford. According to the 2010 US Census, Rockingham County had a population of 295,223 and Strafford County had a population of 123,143.'),(5405,'Who was born first, Fernando Meirelles or Rachel Weisz?','Fernando Meirelles was born first. He was born on November 9, 1955, while Rachel Weisz was born on March 7, 1970.'),(5406,'What is located about 80 km southwest of Grignasco and is the capital of Piedmont?','The capital of Piedmont, located about 80 km southwest of Grignasco, is Turin.'),(5407,'Delta Shuttle serviced which two important East Coast airports?','Delta Shuttle provides frequent daily services between LaGuardia Airport in New Y