yer takes on the role of a fugitive on the run, while the other players take on the roles of detectives trying to apprehend the fugitive. It is usually played with two to six players.'),(5751,'Tazza was a television series starring the actor best known for a leading role in what 2001 film?','Tazza is a South Korean television series that aired in 2008. The series starred actor Jang Hyuk, who is best known for his leading role in the 2001 film \'Volcano High\'.'),(5752,'Wuzhong, Ningxia and Sanmenxia are both what in china?','Wuzhong is a city located in the Ningxia Hui Autonomous Region, while Sanmenxia is a city located in the Henan province of China.'),(5753,'Who is Older Abdul Qadeer Khan or Mostafa El-Sayed ?','Abdul Qadeer Khan is older than Mostafa El-Sayed. Abdul Qadeer Khan was born on April 1, 1936, and Mostafa El-Sayed was born on August 27, 1933.'),(5754,'What number oldest university in Austria contains the The Kanzelhoehe Solar Observatory?','The Kanzelhoehe Solar Observatory is actually run by the University of Graz, which is the second oldest university in Austria after the University of Vienna. The University of Graz was founded in 1585.'),(5755,'Obergefell v. Hodges and the Slaughter-House Cases both have to do with what number amendment on the constitution?','The Obergefell v. Hodges and the Slaughter-House Cases are two cases that deal with different amendments to the U.S. Constitution. Obergefell v. Hodges dealt with the Fourteenth Amendment, specifically the Due Process and Equal Protection Clauses. The Slaughter-House Cases, on the other hand, dealt with the interpretation of the Fourteenth Amendment’s Privileges or Immunities Clause.'),(5756,'New York, Chicago and St. Louis Railroad had primary connections in this city (not Cincinnati) in the U.S. state of Ohio that belongs to which county?','The city that served as the primary connection for the New York, Chicago and St. Louis Railroad in Ohio is Cleveland. Cleveland is located in Cuyahoga County.'),(5757,'What is another name for the dominant vegetation found in the Ochoco Mountains?','The dominant vegetation found in the Ochoco Mountains is Ponderosa Pine.'),(5758,'The Sant Bani School located in the town Sanbornton, New Hampshire is in what county?','The Sant Bani School is located in Belknap County, New Hampshire.'),(5759,'What 1978 album was included on the Paul McCartney Collection, along with a 1978 Wings compilation album?','The 1978 album that was included on the Paul McCartney Collection alongside the Wings compilation album was \'London Town\'.'),(5760,'Pascal Grob is a professional footballer for?','I am sorry, but I am not sure which Pascal Grob you are referring to. Could you please provide me with more context or information on this person?'),(5761,'In what year was the man that committed the murders for which John Button and Darryl Beamish were imprisoned for born?','The man who committed the murders for which John Button and Darryl Beamish were imprisoned was named Eric Edgar Cooke. He was born on February 25, 1931.'),(5762,' Gale Ann Benson, a British model was buried alive in Trinidad by a self-styled black revolutionary and civil rights activist who was executed by what? ','The self-styled black revolutionary and civil rights activist who buried Gale Ann Benson alive in Trinidad was executed by hanging in 1979. His name was Lennox Raphael, also known as \'Ashe.\''),(5763,'How many associate member universities are in the Conference that included a team coached by Ronald Hughey?','Ronald Hughey is currently the head coach of the women\'s basketball team at the University of Houston, which is a member of the American Athletic Conference. The American Athletic Conference has 11 full members and has 2 associate members that compete in women\'s rowing and field hockey respectively. None of these associate members include any universities with a team coached by Ronald Hughey.'),(5764,'Who authored the Scott Act signed by President Grover C