c, Los Angeles Lakers, Miami Heat, Phoenix Suns, Cleveland Cavaliers, and Boston Celtics.'),(5777,'Who hosted the American version of Parir te Karogh Es in its tenth season?','The American version of Parir te Karogh Es is called \'So You Think You Can Dance,\' and the host for the tenth season was Cat Deeley.'),(5778,'What American Christian author born on January 25, 1952 hosted a television series that aired on PAX TV before the network was cancelled?','That would be Frank Peretti. He is an American Christian author who is known for his works of Christian fiction, particularly his bestselling supernatural thrillers. He hosted a television series called \'The Hangman\'s Curse\' which aired on PAX TV before the network was cancelled.'),(5779,'Donald Charles Baldwin achieved significant commercial success with recordings he wrote, arranged and performed for a record company whose name is the same as a poem published in what year?','The record company that Donald Charles Baldwin wrote, arranged and performed recordings for was Stax Records. However, I am not able to find evidence that the company\'s name was the same as a poem published in a specific year. Could you provide further information or clarification?'),(5780,'When was the actress that starred with Sebastián Estevanez, Carina Zampini, Mariano Martínez, Juan Darthes and Sol Estevanez in the telenovela \'Camino al amor\' born?','Carina Zampini, who starred in the telenovela \'Camino al amor\' with Sebastián Estevanez, Mariano Martínez, Juan Darthes, and Sol Estevanez, was born on September 25, 1975.'),(5781,'In what year did Maribel Verdu appear in a movie by the director known for A Little Princess?','Maribel Verdu appeared in the movie \'Y Tu Mamá También\' directed by Alfonso Cuarón in the year 2001. Alfonso Cuarón also directed the movie \'A Little Princess\' in 1995.'),(5782,'Which 215 mile long river joins the River Lea just east of Leamouth?','The river that joins the River Lea just east of Leamouth is 