ina longer?','Eduardo Lonardi ruled Argentina for a shorter period. He was in power from September 1955 to November 1955. Jose Domingo Molina Gomez, on the other hand, did not rule Argentina. There is no record of a person with that name having served as president or held any significant political position in Argentina.'),(6006,'Which award was a Heroes & Zeros star previously nominated twice for at the Africa Movie Academy Awards?','Actor OC Ukeje was the star of Heroes & Zeros, and he was nominated twice for the Africa Movie Academy Award for Best Actor in a Leading Role for his performances in the films \'Alan Poza\' (2013) and \'Ayanda\' (2015).'),(6007,'The last team that David Aliu played for was founded in which year ?','David Aliu\'s last team was the London Lions, which was founded in 2012.'),(6008,'Are Carol Shields and Peter S. Beagle both American novelists?','No, Carol Shields was a Canadian novelist, and Peter S. Beagle is an American novelist.'),(6009,'Where is the rapper from who made an appearance in Trap God 2 and was also affiliated with Freebandz?','The rapper you are referring to is most likely Young Scooter. He is an Atlanta-based rapper who made an appearance on the mixtape Trap God 2 by Gucci Mane, and is also affiliated with the Freebandz record label.'),(6010,'Which member of Gator Country died in 2006?','Gator Country is a Southern Rock band from Jacksonville, Florida. In 2006, one of its original members, Danny Toler, passed away due to complications from a liver transplant.'),(6011,'What is the name of the former insurance investigator on the American television drama series produced by Electric Entertainment which featured a song by The Bravery','The name of the former insurance investigator on the American television drama series produced by Electric Entertainment is Michael Westen. The series is called Burn Notice and the song by The Bravery is called \'Believe\'.'),(6012,'Which is published more frequently, Hour Detroit or MIT Sloan Management Review?','MIT Sloan Management Review is published more frequently than Hour Detroit. \n\nMIT Sloan Management Review is published quarterly (4 times a year), whereas Hour Detroit is a monthly magazine (12 times a year).'),(6013,'When was the administrative region in which Kloster, Denmark is located established?','Kloster is located in the Syddanmark Region (South Denmark Region) of Denmark, which was established on January 1, 2007. The region was created as part of a national reform, which merged the former counties of Fyn, Ribe, South Jutland, Sonderjylland, and Vejle into five larger administrative regions.'),(6014,'what airline company based in Prague chose the airspeed envoy over aero A.204?','I\'m sorry, but I am unable to find the specific answer to your question as it is quite detailed and may require specific knowledge of the airline industry in the Czech Republic. However, I suggest conducting a thorough online search or contacting an industry expert for more information.'),(6015,'What other aircraft did the person who conceived of the Focke-Wulf Fw 187 work on?','The Focke-Wulf Fw 187 was designed by Kurt Tank, who also worked on several other aircraft during his career. Some of his other notable designs include the Focke-Wulf Fw 190 fighter, the Focke-Wulf Fw 44 trainer biplane, and the Focke-Wulf Ta 152 high-altitude fighter.'),(6016,'Which Building is higher 8 Spruce Street or Manhattan West?','The 8 Spruce Street building, also known as the New York by Gehry building, is currently higher than Manhattan West. 8 Spruce Street is 870 feet (265 meters) tall with 76 floors, while Manhattan West is 995 feet (303 meters) tall with 67 floors.'),(6017,'What is the name of the mascot from the University located in Stillwater, Oklahoma?','The name of the mascot from the University located in Stillwater, Oklahoma is Pistol Pete.'),(6018,'At what university if the study for hl-60 cells being conducted?','I\'m sorry, I cannot provide an answer without a