s released in 1969. The film was called \'The Making of the President 1968\' and was edited by Brian Keith.'),(6025,'This coaster with running rails made of flattened steel strips boasts a ride by Rocky Mountain Construction in what city?','The coaster with running rails made of flattened steel strips is called the \'Steel Vengeance\' and it\'s located at Cedar Point, a popular amusement park in Sandusky, Ohio, USA, that was built by Rocky Mountain Construction.'),(6026,'Bat Out of Hell II includes which single released in 1993 with verses credited to Mrs. Loud?','The single released in 1993 from the album Bat Out of Hell II with verses credited to Mrs. Loud is \'I\'d Do Anything for Love (But I Won\'t Do That)\'.'),(6027,'Which building is/was taller, Latting Observatory or General Motors Building?','The General Motors Building is taller than the Latting Observatory. The General Motors Building stands at 705 feet (215 meters) with 50 floors, while the Latting Observatory was only 315 feet (96 meters) tall.'),(6028,'Himalaya Airlines was the second attempt of what Nepal-based airline to launch an international presence?','Himalaya Airlines was the second attempt of Yeti Airlines to launch an international presence. Yeti Airlines is a major domestic airline of Nepal.'),(6029,'The 1980 Christmas album Give Love at Christmas which includes \'This Christmas\' and \'The Little Drummer Boy\' features what musical group?','The 1980 Christmas album Give Love at Christmas that features \'This Christmas\' and \'The Little Drummer Boy\' was performed by the musical group, The Temptations.'),(6030,'Fantasia Gardens is a miniature golf course that opened to commemorate the film that contained music by whom?','Fantasia Gardens is a miniature golf course that opened to commemorate the film \'Fantasia,\' which contained music by composer Wolfgang Amadeus Mozart, Ludwig van Beethoven, Johann Sebastian Bach, Pyotr Ilyich Tchaikovsky, and others.'),(6031,'Which BBC television sitcom based on a 1990 \'French & Saunders\' sketch is directed by Bob Spiers? ','The BBC television sitcom based on a 1990 \'French & Saunders\' sketch that is directed by Bob Spiers is \'Absolutely Fabulous\' (often referred to as \'Ab Fab\').'),(6032,'Ralph McLean was the first openly gay person ever elected as a mayor of which inner-city suburb of Melbourne, Victoria, Australia?','Ralph McLean was the first openly gay person ever elected as a mayor of the inner-city suburb of Stonnington in Melbourne, Victoria, Australia.'),(6033,'Familial is an album by the drummer of a band formed in which year ?','The album \'Familial\' was released by Radiohead\'s drummer Philip Selway in 2010.'),(6034,'What is the nickname of the American singer-songwriter who released \'When He Walks on You (Like You Have Walked on Me)\'?','The American singer-songwriter who released \'When He Walks on You (Like You Have Walked on Me)\' is Patsy Cline, and she was also known as \'The Queen of Country Music\'.'),(6035,'The American country music singer who is a cousin of Terry Eldredge released this song on June 28, 2011?','The American country music singer who is a cousin of Terry Eldredge and released a song on June 28, 2011 is Chris Young. The song is titled \'Tomorrow\'.'),(6036,'What is the name of the town, in Aroostook County, where the Loring Military Heritage Center is located?','The town where the Loring Military Heritage Center is located in Aroostook County, Maine is Limestone.'),(6037,'What is the city of the radio show which airs a program based on the american historical theologian.','I\'m sorry but I cannot provide an accurate answer without more specific information. Can you provide me with the name of the radio show or the theologian?'),(6038,'What is the name of the book written about a fictional British writer alleged to have make contact with a native inhabitant of the planet Mars?','The book you are referring to is called \'The War of the Worlds\' by H.G. Wells. It tells the story of a fictional invasion of Earth by Martians who had been observing Earth and made plans to invade the planet.'),(6039,'Which mountain\'s peak was first ascended to by humans, Sunanda Devi or Nangpai Gosum?','The peak of Nangpai Gosum has not been fully climbed, and it remains unclimbed to this day. On the other hand, the peak of Sunanda Devi has been climbed several times, so the answer to your question is Sunanda Devi. The first successful ascent of Sunanda Devi was made in 1939 by a British team consisting of Bill Tilman and Noel Odell.'),(6040,'What was the name of the conflict between Sweden and Poland consisted of the Battle of Kiezmark and ended with the Treaty of Stuhmsdorf?','The conflict was called the Livonian War, which occurred from 1558 to 1583 and involved several countries including Sweden, Poland, and Russia. The Battle of Kiezmark took place in 1587 and the Treaty of Stuhmsdorf was signed in 1635, marking the end of the Polish-Swedish War.'),(6041,'Jonathan Morgan Heit played the role of Patrick in a 2008 film written by who?','Jonathan Morgan Heit played the role of Patrick in the 2008 film \'Bedtime Stories\', which was written by Matt Lopez and Tim Herlihy.'),(6042,'In between Hamlet and Oedipus rex, which one was by Igor Stravinsky?','Neither Hamlet nor Oedipus Rex was composed by Igor Stravinsky. However, Stravinsky did compose several notable works throughout his career, including The Rite of Spring, The Firebird, and Petrushka.'),(6043,'Who is the grandfather of David Michael Bell?','I\'m sorry, I do not have enough information to provide an answer. Can you please provide more context or details about David Michael Bell\'s grandfather?'),(6044,'Consider the team for George Hardwick was a left-sided defender. What are they currently competing in?','I\'m sorry, but I would need more information to provide an accurate answer. Can you please clarify which team you are referring to?'),(6045,'What is an accomplishment of the former football player who is also an Italian football manager in charge of A.C. Milan Primavera?','The former football player who is also an Italian football manager in charge of A.C. Milan Primavera is Filippo Inzaghi. One of his greatest accomplishments as a player was scoring twice in the 2007 Champions League final to help AC Milan defeat Liverpool 2-1. As a manager, he led Venezia to Serie B promotion in the 2016-2017 season.'),(6046,'What is the minimum weight of the division in which Mark Holata competes in?','Mark Holata is a retired American mixed martial artist and former professional heavyweight fighter. He mostly competed in the heavyweight division of different MMA promotions throughout his career. The weight limit for the heavyweight division in most MMA promotions ranges from 206 pounds (93.45 kg) to 265 pounds (120.2 kg).'),(6047,'Who is the who is the Lieutenant Governor of California since 2011 to whom Biotic Baking Brigade threw a pie at?','The Lieutenant Governor of California since 2011 is Gavin Newsom. He was the target of the pie thrown by the Biotic Baking Brigade in 2003 during his term as the mayor of San Francisco. The pie throwers objected to Newsom’s policies on homelessness and gentrification.'),(6048,'What television writer wrote for \'Saturday Night Live\' and wrote an episode of a television show in which Albert Brooks guest stars?','The television writer who fits that description is James L. Brooks. He wrote for \'Saturday Night Live\' early in his career and later went on to create and write for popular sitcoms such as \'The Mary Tyler Moore Show\' and \'The Simpsons\'. He also wrote an episode of the sitcom \'Taxi\', in which Albert Brooks guest stars.'),(6049,'What tune is most associated with the dance made famous by Rigolboche?','The tune most associated with the dance made famous by Rigolboche is called \'Le Grand Galop,\' composed by Jacques Offenbach.'),(6050,'What profession does Mount Borodin and Alexander Borodin have in common?','Mount 