rco\'s Pizza or Straw Hat Pizza?','Straw Hat Pizza was founded by an immigrant named Charlie Olsen in 1959.'),(6420,'who passed away first, George Wallace or James Hood ?','George Wallace passed away before James Hood. George Wallace died on September 13, 1998, while James Hood passed away on January 17, 2013.'),(6421,'Which footballer who is  widely regarded as the greatest football player of all time participated in the 90 Minutes for Mandela football match?','The footballer who is widely regarded as the greatest football player of all time and participated in the 90 Minutes for Mandela football match is Pelé from Brazil. This match was played on July 18, 2007, at Newlands Stadium in Cape Town, South Africa, to mark the 89th birthday of former South African President Nelson Mandela.'),(6422,'Currently, is the United Kingdom\'s National Lottery franchised by a public or state organization?','The United Kingdom\'s National Lottery is currently franchised by a private company called Camelot Group. Camelot was awarded the franchise by the UK government in 1994 and has been operating the National Lottery ever since.'),(6423,'Who is the daughter of the heir apparent to the throne of Denmark?','The daughter of the heir apparent to the throne of Denmark is Princess Isabella of Denmark. She is the second child of Crown Prince Frederik and Crown Princess Mary.'),(6424,'Which show brought one of Uncle\'s stars to prominence? ','Uncle is a British television sitcom that aired on BBC Three from 2005 to 2007. One of its stars, comedian and actor Nick Helm, gained prominence from the show.'),(6425,'Peter Wright was the Chief Constable of the South Yorkshire Police during the Hillsborough disaster in 1989, which claimed how many fatalities?','The Hillsborough disaster in 1989 claimed the lives of 96 football fans.'),(6426,'What notable accomplishment\'s have Paul holland\'s english teammates achieved?','\nThere are several notable accomplishments achieved by Paul Holland\'s English teammates, including:\n\n1) Gary Lineker, England\'s second all-time leading goal-scorer, won the Golden Boot at the 1986 World Cup and led England to the semi-finals of the tournament.\n\n2) Peter Shilton, England\'s most-capped player and goalkeeper, played in three World Cups and helped England win the 1980 European Championship.\n\n3) Bryan Robson, former captain of the England national team, played in three World Cups and was named the \'Captain Marvel\' for his leadership and performances on the pitch.\n\n4) Terry Butcher, former defender for the England national team, played in three World Cups and was known for his tough and aggressive style of play.\n\n5) Tony Adams, former defender and captain of the England national team, played in two World Cups and was instrumental in Arsenal\'s success during the 1990s, winning four league titles and three FA Cups.'),(6427,'The Craigieburn Football Club is located in north of what district in Melbourne?','The Craigieburn Football Club is located in the Hume district, which is in the northern suburbs of Melbourne.'),(6428,'Which Chinese city has a higher population, Kashgar or Shanghai?','Shanghai has a much higher population than Kashgar. According to recent estimates, Shanghai\'s population is approximately 24 million, while the population of Kashgar is around 500,000.'),(6429,'What company built its first car in 1940 and sold sports cars under the Dino marque between 1968 and 1974?','The company that built its first car in 1940 and sold sports cars under the Dino marque between 1968 and 1974 was Ferrari. The Dino marque was created to market cars with engines that had fewer than 12 cylinders, which were the typical engines used by Ferrari at the time.'),(6430,'Dennis Leeflang is best known for his work with one of the lead guitarists of which band?','Dennis Leeflang is best known for his work with the lead guitarist of Guns N\' Roses, Slash. He played drums on Slash\'s 2010 self-titled debut solo album and has also performed live with him.'),(6431,'What is the nickname of the Slipknit band member that was replaced by Mick Thomson?','The Slipknot band member that was replaced by Mick Thomson does not have a nickname as he was the original guitarist of the band prior to Thomson\'s addition. However, the band member who is commonly known by a nickname is percussionist Shawn Crahan, who goes by the stage name \'Clown.\''),(6432,'Himalayan Bank Limited was  incorporated in 1992 by a few eminent individuals of Nepal in partnership with the Employees Provident Fund and a Karachi based multinational bank now referred to as what?','The Karachi based multinational bank that partnered with Himalayan Bank Limited in 1992, is now referred to as Habib Bank Limited.'),(6433,'Which is a movie, White Fang 2: Myth of the White Wolf or Alfredo Quinones-Hinojosa?','\'White Fang 2: Myth of the White Wolf\' is a movie, while \'Alfredo Quinones-Hinojosa\' is not a movie but a well-known neurosurgeon and medical researcher.'),(6434,'Out of Shogun and Tikal, who had more creators?','If we consider \'creators\' as the number of designers and developers involved in the creation of the games, then Tikal had more creators than Shogun.\n\nTikal was designed by Wolfgang Kramer and Michael Kiesling, and published by Rio Grande Games in 1999. It involved a larger team of artists and graphic designers for the game\'s illustrations and components.\n\nShogun was designed by Dirk Henn and published by Queen Games in 2006. Although it involved a team of artists and graphic designers as well, it had a smaller team of designers and developers than Tikal.'),(6435,'Jean-Pierre Serre was a French mathematician known to have won the Fields Medal and this prize that came with how much?','Jean-Pierre Serre was awarded the Fields Medal in 1954, which is considered one of the highest honors in mathematics. Additionally, he was awarded the Abel Prize in 2003, which comes with a cash prize of 6 million Norwegian kroner (approximately 700,000 USD at the time).'),(6436,'Who had the better career-high singles ranking in the world, Henri Leconte or Ivan Dodig?','Henri Leconte had the better career-high singles ranking in the world. He achieved a career-high ranking of No. 5 in the world in March 1986. On the other hand, Ivan Dodig\'s highest singles ranking was No. 29 in the world, which he achieved in July 2018.'),(6437,'What is the comparable caricature involving African-Americans that was used in films such as \'Grindhouse?\'','The caricature involving African-Americans that was used in films such as \'Grindhouse\' is commonly referred to as the \'Magical Negro\' stereotype. This stereotype portrays African-American characters as existing solely to help white characters achieve their goals, often possessing supernatural abilities that they use to help the white characters. It is considered offensive as it reduces African-American characters to one-dimensional tropes and reinforces the idea of White Savior Complex.'),(6438,'What open wheel, single seat racing series did Dan Ticktum compete in during 2017?','Dan Ticktum competed in the FIA F3 European Championship in 2017.'),(6439,'The 2006 Kansas Jayhawks football team were coached by which American football coach, who until October 26, 2015 served as offensive coordinator and tight ends coach at Iowa State University?','The 2006 Kansas Jayhawks football team were coached by Mark Mangino, who until October 26, 2015 served as offensive coordinator and tight ends coach at Iowa State University.'),(6440,'On February 2,1864 in the war when Danevirke was last used, the first Battle between which armies occured?','The first Battle of Schleswig was fought on February 2, 1864, between the German Confederation and the Danes. It was fought near the town of Danevirke in northern Germany during the Second Schleswig War. The German Confederation won the battle and captured the town.'),(6441,'Does Liriodendron genus have more species than Syzygium genus?','No, Liriodendron genus only has two species of trees (Liriodendron tulipifera and Liriodendron chinense), while Syzygium genus has over a thousand species of trees and shrubs, making it one of the largest genera of flowering plants.'),(6442,'What was career in 2001 of the person that Ann O\'Leary assisted in the 2016 presidential election?','I\'m sorry, but your question is not clear. I need more context to provide an accurate answer. Which person are you referring to? Can you please provide more details?'),(6443,'The 1978 film FM starred what actor who died October 22, 1992?','The 1978 film FM starred Michael Brandon who is still alive as of today. No cast members from the film died on October 22, 1992.'),(6444,'Are Max W. Kimmich and Mark Rydell both film directors ?','Yes, Max W. Kimmich and Mark Rydell are both film directors. Max W. Kimmich was a German film director who worked during the early part of the 20th century, while Mark Rydell is an American film director, producer, and actor who has been active since the 1950s.'),(6445,'Which genus of plant mostly originates from North America, Sphaeralcea or Gordonia?','Sphaeralcea mostly originates from North America, specifically from arid and semi-arid regions in the western United States and northern Mexico. Gordonia, on the other hand, mostly originates from Asia, particularly in China and Japan.'),(6446,'Do both filmmakers Gil Kenan and Vincent Kok work as an actor?','No, neither filmmaker Gil Kenan nor Vincent Kok primarily work as actors. Gil Kenan is a director, screenwriter, and producer who is best known for his work on the movies \'Monster House\' and the 2015 remake of \'Poltergeist.\' Vincent Kok is a Hong Kong-based director, screenwriter, and producer who is known for his work on Chinese-language comedies such as \'Gorgeous\' and \'Love Undercover.\' While it\'s possible that either of them might have had a small acting role at some point in their careers, their primary work has been in writing, producing, and directing films.'),(6447,'What concentration camp opened 3 years after the first Nazi camps were erected?','The concentration camp that opened three years after the first Nazi camps were erected was the Buchenwald concentration camp. It was established in 1937 and was one of the largest concentration camps in Germany, holding prisoners from all over Europe.'),(6448,'Pentetic acid can be viewed as an expanded version of which chemical that can used for both industrial and medical purposes? ','Pentetic acid is an expanded version of the amino acid glycine. Glycine can be used for both industrial and medical purposes, such as the production of pharmaceuticals, food additives, and animal feed.'),(6449,'Are the Sealyham Terrier and Saluki both European breeds of dog?','No, the Sealyham Terrier is a Welsh breed of dog, while the Saluki is an ancient breed from the Middle East. Sealyham Terriers are small, muscular terriers that were originally bred to hunt vermin, while Salukis are tall, lean dogs that were used for hunting game such as gazelles and other desert animals.'),(6450,'What author who sold over 600 million copies of his books wrote about an elephant that tried to keep an egg warm through storms? ','The author who wrote about an elephant that tried to keep an egg warm through storms and sold over 600 million copies of his books is Dr. Seuss, and the book is called \'Horton Hatches the Egg.\''),(6451,'What is the concept of \'qi\' in reference to Feng shui and Ancient Chinese urban planning?','Qi is a concept in Feng Shui that refers to the energy or life force that flows through everything in the universe. It is also believed to be affected by the arrangement and orientation of buildings, furniture, and other elements in the environment. In Ancient Chinese urban planning, the flow of qi was considered an important factor in determining the location and layout of buildings and streets, with the aim of creating a harmonious and balanced environm