, Quebec, Canada.'),(6621,'Of the two abandoned mines in Ontario, Canada, McIntyre Mines or Norrie Mine, which is not an Underground gold mine?','The Norrie Mine is not an underground gold mine. It is an open-pit iron mine located in Sudbury, Ontario. The McIntyre Mines, on the other hand, are underground gold mines located in Timmins, Ontario.'),(6622,'What university featured the former Vanderbilt coach and plays at Beaver Stadium?','The university you are referring to is Penn State. Beaver Stadium is located in State College, Pennsylvania and is the home stadium of the Penn State Nittany Lions football team. The former Vanderbilt coach you mentioned may be referring to James Franklin, who is currently the head coach of the Penn State football team.'),(6623,'Did Mario Benedetti and Gertrude Stein both use their birth names?','No, they didn\'t. Mario Benedetti\'s birth name was Mario Orlando Hamlet Hardy Brenno Benedetti Farrugia, and Gertrude Stein\'s birth name was Gertrude Amelia Stein. Both authors chose to use modified versions of their birth names as their pen names. Mario Benedetti dropped some of his middle names, and Gertrude Stein dropped her middle name and added her mother\'s maiden name as a middle name.'),(6624,'What was the name of the \'The Young and the Restless\' character played by that actress, known for playing Gabrielle Solis on the show written by written by series creator Marc Cherry?','The actress you are referring to is Eva Longoria and she did not appear in \'The Young and the Restless\'. She is best known for playing Gabrielle Solis on the show \'Desperate Housewives\', created by Marc Cherry.'),(6625,'What\'s birth year of the Moroccan producer behind the group Stockholm Syndrome?','I\'m sorry but I couldn\'t find any specific information about the birth year of the Moroccan producer behind the group Stockholm Syndrome in my sources. However, Stockholm Syndrome is a group comprised of two Moroccan producers - Amine Mesnaoui and Youssef 